charset["甲骨文詞譜"]="𡟓安八巴豝白百敗𢱭般邦勹雹宀保寶豹𧇑北貝僃偪柲𣴨鼻匕比啚畀𢌿𣴡敝邊釆賓𧲏兵丙抦秉并併並帛泊亳駁卜卟不步才采湌䝳倉㯥冊曾茶𧍣𢽝蟬𣅊昌長厂鬯朝漅車屮徹臣辰莀晨䢅塵𨳐爯偁成呈承宬乘𨾽𢕌齒赤敕𢽟沖舂虫𠃬疇𧙻醜臭出初芻楚豖畜䜴川傳吹桘旾春滣㲋娕𢔄祠辭此朿次𢅜从𢓅從崔虘达大眔卩丹單旦彈宕刀𣱼盜得登𤼷厎弟帝禘典奠弔𣧈丁鼎定冬東㚵涷陡豆鬥𠁁妬𠂤队兌陮對敦盾多俄娥𣦵歺𡵖而兒耳洱䋙發伐凡反匚方非渄分焚丰妦封𢓱豐夆綘鳳缶𡜊夫弗甶孚刜𦨈俘鳧福箙甫斧阜复婦復腹𢻰匄甘𡶩剛高膏告戈戓革𢓜鬲閤各亘亙庚更工弓厷公宮龏龔𠬞共冓𦊒遘谷骨鼓穀蠱雇冎关官館盥雚光龜歸騩宄鬼𣪕䌆郭𩫏果還圅𣐺𣻦熯行蒿椃好禾合何河姀䢔龢寉黑弘虹娂𨾊𥎦后厚後乎呼𠦪狐壺虍虎俿戶化㕦𢦚畫澅淮洹萈萑雈㞷𡉚𡴍黃潢䝅𩲡彗湏會昏𡇯火沎禍霍𤼥姬基箕櫅雞鷄羈及𨸚吉彶即𡜍疾集耤丮𠯎旡季既祭㠱㡭稷穧繼家豭夾斝戔㦰湔監艱見薦𢪇將弜降交蛟角烄䘨教皆魝介今伒盡京晶井汫妌竟競囧丩𠛩酒紤𡆥咎就舊𣻐氒珏𧣇爵君𦉼麇亢尻丂克墾口叩寇夸𣥈𢌳戣𩀁𧷛䖵困𣏔𦎫剌來徠婡婪牢老雷犁𠭰驪豊力立吏利𥝢砅栗秝䰛歷𩣫麗良量潦寮燎劦林𠵂粦𪊓潾㐭吝焛夌彾紷霝令龍嚨瀧盧魯彔鹿䐂塶㯟𦌏麓䜌侖𦝠洛𩂣呂旅律率馬遤埋霾買麥澫汒尨莽卯懋㺳枚眉湄𤃱每美妹𢦹鬽媚門盟孟夢麋米糸𥄃娩面苗蔑皿敏黽名明冥鳴𤤄殁𥄕莫母牡木目牧𦨧暮穆𦬻吶乃艿迺鼐囡男南猱夒內秜麑柅屰逆年輦娘鳥尿㘝㚔臬㴪宁寍寧倿妞牛辳奴奻女爿㝑旁龐配轡朋倗彭伓皮埤𩫫辟䑄品牝荓攴僕妻戚霋祁其肵棋齊乞企杞𣏌呇启𢼄啟啓婍晵棄㓞千拪歬𠳋欠㐸羌戕㳾牆妾𡝍亲秦嫀𡨦寢沁吢慶磬丘秋囚渞裘區𩡶䵶取齲去刞权泉犬雀冉㚩人壬刃任妊戎宂肉如汝乳朊汭若彡㪔散桑喪𡠏埽嗇𥢺山杉羴商滳䵼上尚少𠧙卲舌𢎤射涉設𡠽麝申㕥身柛𢓠沈矤㚞升生𥘥聲省圣𦔻尸𢼊石食姼史矢豕使屎駛氏示事室奭𦣻首受狩殳疋叔書𦉶黍蜀鼠戍束捒𠊪庶㛸爽脽水䀢司㚸絲㺇死巳罒兕祀𧰽禩㣈宋𡖊㑛餗𥝩㒸祟𡟝歲穗孫𠣤𠣬它沓太䊤𧫿唐忒洟天田畋条𠧪同𣪌𠫓𨑒𢓊途涂梌土兔屯豚乇拕䭾橐妥媧完宛万萬亡王网往𦣠望危為韋唯圍𩎴尾畏衛文聞我婐硪巫𢀣毋吳無武舞勿戊騖夕兮西昔析奚厀膝嬉習騽喜系𠰝係㣟𡭴𦵯下屳先㳄弦咸涎𧺻臽俔宪莧陷獻㿝相鄉襄祥絴享亯𦴒饗向象項婋小校效協媟謝燮心辛杺訢新囟炘信䏤星鮏䳙杏姓興兄兇休羞宿戌須玄旋䲻䀏𢕐辥學雪血循尋訊亞婭言炎喦㫃酓晏焱燕鬳央羊昜洋卬䍩夭爻堯叶頁伊衣依𣐿𢓚宜䧅㝖彝乙以㠯攺乂弋伇亦㚤抑邑易炈㳑㣇俋疫益埶豛隿異翌義蓺藝因冘寅尹𢎢𢏂飲㱃印庸雝永用攸幽尤由䢊斿𠧴猶猷友酉卣又幼𤴨囿祐𡜳䀁于余盂𩁹魚畬湡艅漁䰻羽㲾雨圉玉聿䢖馭毓鳿禦鬱𣶒眢淵元爰袁員遠曰月戉刖枂岳樂龠暈云允孕𡢘雥𢦏災甾仔𣅁宰䣬載𩛥𠵃𦣣葬𠴵則𧵩夨昃𠭯乍柵宅㫋占㕚召兆𦋜肇𥃝折貞姫裖朕𦨶䟴征爭姃蒸正之㞢𥃫隻戠姪執嬂止旨沚祉砋黹至豸陟徝彘置雉廌疐𨖹中終眾舟周𠣘洀婤肘㫶呪冑帚鼄竹逐主佇壴祝貯鑄叀𠨎𠨖妝樁隹追沝墜涿𢧈灂茲淄髭子𠂔吇自宗走奏𥎩族俎祖㝡左𥙀作𢼎匁㣕㳣𠄺𠇦𠊡𠋥𠯤𠳛𠵤𡘽𡚵𡛏𡜐𡞗𡠵𢀛𢎿𣏮𣕜𣜋𣲧𣼳𤜪𦰩𪥧𪧇𪧭𪨤𪪶𪪺𪯌𪵳𪷾𪸘𪻍𪾏𫅊𫅎𫇆𫡜𫢁𫢞𫤮𫦀𫦎𫨽𫩀𫩁𫩐𫩨𫩻𫪮𫭠𫮩𫯀𫯢𫯦𫰉𫰒𫰖𫰧𫲟𫳅𫳒𫳛𫸝𫸥𫸧𫸵𫹉𫹔𫻨𫻺𫼆𫾩𫾹𬀈𬃽𬅾𬆥𬆩𬆬𬇖𬇾𬉖𬋿𬌪𬒯𬓨𬓷𬔖𬗪𬙮𬚪𬛧𬛫𬛶𬜠𬟏𬟧𬟭𬠾𬠿𬡤𬩚𬪹𬯂𬯚𬯪𬯭𬴲𭑈𭑧𭒹𭓞𭶯𮁟𮁧𮦋";
charset["甲骨文虛詞詞典"]="必𠨘竝不𨒬遲此從大鼎兌爾非弗改後乎惠及即既暨鹹弜𡆥厥歷孿率乃迺女其氣若巳同唯我毋勿先延羊眻亦抑異永用由有於俞餘允在朕之戠執至終茲自卒作𣑵";
charset["甲骨文字典"]="安八白百柏敗𠦒般邦包宀保寶勽虣卑𠔁北貝狽㛝皀偪柲匕比妣啚鄙𠨘畀𢌿畢敝婢飶駜避嬖𤐧編弁㝸𢍙豩賓儐兵丙秉柄疒并並竝伯帛亳駁卜不步才采蔡倉曹㯥𣍘冊𣌧曾祡㢟𣬕燀長厂鬯朝車屮徹䑣臣辰晨䢅爯偁成丞承乘蚩遲齒赤沖舂虫丑醜臭出初芻媰雛楚畜川傳吹𠂹春辵祠𥿆此朿从從虘大眔卩丹單撣旦宕刀盜稻䙷得登豋𢍪𧯭狄杕弟帝禘典奠㝪弔眣耋䠟丁鼎定冬東抖斗豆鬥𨪐杜𠂤兌陮對沌多妸妿娥歺𠱫𥩭𥩮而兒耳洱䋙爾二發伐姂凡反匚方妃非分燓鼖豶糞丰封風豐鳳缶𡜊夫𠬝弗甶孚刜俘福箙甫斧父阜𨸏复婦復腹𡉅匄㕢甘𠭖敢干犅高羔膏告祰戈鬲各亘庚更工弓厷公宮觵龏共冓䝭遘古谷羖鼓蠱雇冎剮官觀毌盥雚光龜歸宄鬼癸𣪕簋貴郭𩫏國聝虢還亥圅涵𣹢𣐺熯鶾行𣃚蒿𣘫好禾合何河䢔龢恆弘虹𨾊鴻侯矦后厚後乎呼𠦪𧦝狐壺觳虍虎戶濩㭉化𢦚澅淮洹萑宦圂豢𡉚黃潢隓彗會昏火或禍獲鑊靃姬基箕雞羈及吉彶即亟卽𡜍疾㗊集耤雧己丮𠃨旡季茍洎既旣祭㠱跽稷家嘉豭夾甲斝戔㦰湔監艱䶬見𢪇姜畕弜降洚畺交𪚰角烄教皆解介戒巾斤今堇晉進盡京晶兢井阱汫妌倞競囧丩九酒紤咎㲃舊𥇛𣻐句具𧯦𦍆夬氒玨玦珏桷絕爵君麇畯穅丂可克口狂亏𢌳媿䖵困𦎫剌來婪狼牢老雷靁𠭰釐離驪豊力立吏利戾砅栗秝歷濿麗良潦寮尞劦𡿪𩢾林霖麐㐭吝焛紷霝令柳六龍瀧龓盧爐鹵魯彔陸鹿漉䍡麓侖羅洛𩂣濼呂旅律率綠馬薶霾買麥曼尨杗莽卯冃皃枚眉湄每美沬妹鬽媚門冡𦊽𥁰㝱麋麛米羋糸宓𥁑密免㝃面蔑皿敏黽名明鳴命莫母牡木目牧穆乃艿廼𠧤迺男南夒㕯內秜㲻屰逆溺年卄廿娘鳥尿㞙臬㴪宁寍寧濘牛沑弄奻女派槃磐旁龐浿轡朋倗彭澎炋郫辟片嬪品牝甹葡僕璞七妻祈棊齊企杞𣏌启啟晵气棄㓞千䇂歬遣欠羌戕牆且妾侵秦禽雂嫀寢𠨍丘秋汓逎裘區取娶𤘐齲去泉犬𣪊雀冄㚩人壬任妊仍𠧟日戎宂肉如儒汝乳入蓐叒若爇洒卅塞三彡㪔桑喪埽色嗇森殺翣霎山羴善譱商𥏫滳𩰱䵼上勺少紹舌社射涉䠶𣻣申身娠沈矤升生牲聲省盛聖尸𢼊師溼十石食祏姼史矢豕使屎𩢲示事室冟首受狩獸疋叔秫黍蜀戍束庶𧗿水瞚司絲㺇死巳四汜兕祀泗㭒飤𤉡肆嗣㣈宋叜夙𡖊粟夊㒸歲孫𠣬索它𥾁唐濤貣天田畋㐁𠧪聑聽𧖧𧖨庭通同頭𨑒徒途涂土兔屯𡱂豚乇拕柁橐鼉妥萬亡王网往望朢𣁋為韋唯爲𩏏尾委洧未畏軎衛䘙鏏文聞紊問我硪巫毋無五午武舞兀勿戊物夕兮西昔析奚嬉熹習騽𨑭徙喜卌系下先㳄弦咸臽俔睍獻相香鄉亯饗向象小效斅協燮𤏻辛昕新薪炘星曐𩥍幸姓興兄休羞宿戌需續吅宣旋辥雪䨮血𥄎旬恂侚訊亞婭厃言喦虤㕣㫃衍演縯甗妟焱燕鬳央羊昜徉養夭爻堯野頁一伊衣医依褘夷宜疑彝乙以㠯乂弋𢑏亦邑役易㣇益浥埶異翊㓷肄義𢑩劓因音㐺乑犾㹞寅嚚尹引飲㱃䧹賏𨿳墉雝永泳用𢆶攸幽尤䢊𠧴猶游友有酉卣又右幼囿祐姷于余盂雩魚榆漁羽雨匬圉玉聿育昱浴御禦鷸眢淵䨊元爰員𧻚曰月戉刖礿樂嶽龠暈雲允孕雥𡿧𢦏甾烖宰再在𩛥兂臧葬責𧵩夨仄昃𠭯乍柵宅㠭占㕚召肁𦋜肈折貞栕姫朕䟴𨒌征正之隻戠直姪執止旨沚祉黹至豸陟徝彘雉廌𢄢疐摯𨖹中終仲眾舟州周疛帚朱逐壴祝貯鑄耑專𠨎妝隹追沝涿卓斫灂茲子𠂔自字胾宗掫足族俎祖尊𠂇左作𬚮㭉";
charset["甲骨文字編"]="𡟓安八巴霸白百敗般邦㭋苞雹宀保寶豹虣北貝狽備誖奔偪柲𣴨鼻匕比沘妣啚鄙𠨘畀敝飶駜濞璧編邊釆鼈𠛰𨒜賓𧲏兵丙秉并並帛駁豰𣡌卜不步才采䝳憯倉曹㯥冊曾𡝐瘥𢽝昌長鬯朝漅車屮徹臣辰晨䢅塵𨳐爯偁成丞呈承乘遲齒赤𢽟沖舂虫𣕾丑醜臭出初芻楚豖畜䜴琡川傳吹桘春逴㲋娕𥿆辝此朿次𢅜悤从𢓅琮搓虘达𩣯龖大眔𦬊帶戴卩丹單旦宕刀盜得登隥迪𨒔杕弟帝典奠㝪弔耊耋丁鼎定冬東㚵涷斗豆鬥剢𣈉杜度螙殬𠂤𣳨队兌祋陮對敦盾多𡖇妸娥𣄰歺軛𡵖兒耳洱䋙邇二刵發伐凡匚方防㕫非𨵈分焚糞丰風豐夆逢鳳缶𡜊夫𠬝弗伏扶孚刜𦨈服畐鳧箙甫斧父阜复𠣴婦腹𥫭改匄甘干剛高膏槁告戈戓革𢓜鬲閤各亘亙庚更工弓公肱宫宮䐵龔𠬞共冓遘古谷鼓瞽蠱雇煱冎官觀冠祼光廣圭龜歸騩宄鬼癸𣪘𣉨鯀郭聝馘亥害函圅涵𣻦熯行豪好禾合何河姀䢔盍闔龢寉黑𧝒弘虹䂫鴻侯吽厚後乎𠦪狐壺虍虎唬戶化㕦𢦚𤱪畫澅淮𩿊洹萈萑雈㣪衁凰黃潢䌙䝅悔𩲡彗會昏𡇯火惑霍獲䨥鑊𨹷姬基箕櫅雞躋羈及𨸚吉彶即亟𡜍疾㗊集耤己丮𠯎旡季𢗹洎既祭㠱㡭穧家嘉豭夾甲斝賈稼戔肩兼監艱殲䶬翦見建薦姜畕將弜降洚郊膠角教皆階街截解丯介戒巾斤今晉㶳進盡坕京晶井汫頸妌竟競囧丩九酒𡆥咎就舊娵𣻐句𥉁玨𧣇厥㸕爵君𦉼麇畯侃康亢丂柯疴可𠚰克𦚋口叩寇夸𣍦𢌳𧷛䖵困𣏔剌來婡婪㓪牢勞老雷㵢𥃇𠭰里豊力立利砅栗蒚歷𩣫櫟麗𩱇良量遼潦寮燎劦林𠵂粦𪊓潾霖臨麐廩吝焛夌紷霝𪛈令柳六龍嚨瀧聾盧魯櫓彔陸鹿䐂塶麓𦝠𦟀洛𩂣濼呂旅履律率綠𩴐馬遤鎷霾買麥澫汒杧尨莽卯懋枚眉湄每美沬妹𢦹鬽媚門𦊽𥁰孟夢麋米糸宓𥄃𥁑娩冕面𥄲滅蔑民捪皿敏黽名明眀鳴𤤄殁莫母牡木目牧暮穆乃迺男南夒內秜麑㲻屰逆匿惄年輦廿念娘鳥尿㘝㚔臬㴪孽宁寍寧嬣倿濘妞牛沑奴奻虐女爿盤旁龐配轡朋倗彭伓炋埤貔羆辟品牝甹攴㧃僕璞七妻戚霋祁其肵祈棋齊乞企杞𣏌呇启𢼄啟啓晵棄㓞千臤牽遣欠㐸羌戕㳾牆殼且妾𡝍侵𣪄秦禽嫀寢沁吢𠨍慶磬丘秋求裘區𩡶曲取齲去刞权泉犬雀冉瀼人壬朲刃任妊扔日戎冗肉如汝乳辱入蓐若卅塞三彡散桑喪𡠏埽瑟嗇森沙山芟杉刪羴蟺商滳上卲舌𢎤射涉𡠽麝申身罙柛𢓠娠深紳沈矤升生𥘥聲省尸𢻱十石食祏姼史矢豕宩屎駛示市室視釋㝊守首受狩㖟殳疋殊孰𦉶黍鼠朮戍束𠊪庶豎帥爽脽水順司㚸絲㺇死巳四汜兕祀飤肆宋搜嗽夙速夊𥝩歲孫𠣤𠣬所索它她沓㣛臺貪𣸙𤆌覃潭檀䊤𧫿唐濤匋忒天田畋㐁聑聽庭𡈼通同桐童𣪌𠫓突徒途涂梌土屯豚臀乇橐鼉妥𣵾外刓宛万萬亡王𦣦网往網望危𣁋為韋唯惟爲𩎴𩏏尾未畏衛𥁕溫文聞問我硪巫毋吾無五午武舞勿戊𡵉夕兮西昔析奚屖厀膝嬉熹羲習騽徙喜係𦵯舝下先㳄弦咸俔宪莧陷獻㿝相襄祥絴享亯饗向象小效媟燮心辛昕訢新歆炘星鮏杏姓興兄休羞宿戌𤈎須暊宣玄旋𢕐薛學雪𥄎旬循尋噚迅侚訊亞婭延言妍炎訮喦詽虤㕣㫃𨒄衍酓甗焱燕央羊昜徉陽揚䍩恙夭爻堯繇杳曣野枼頁一伊依夷𢓚宜䧅𠤗宧疑彝乙以乂弋刈伇亦㚤抑邑易㳑益埶豛異逸翌義劓翼藝因殷陰㹞寅嚚尹引𢏂𣲎飲𥑿庸雍雝永踊用攸幽尤由斿猶友𣏀有酉卣又右㓜幼𤴨侑囿祐于余盂臾竽俞雩魚湡漁雨圉玉聿御毓禦鬱淵鳶元爰袁員遠苑曰月戉刖枂岳樂龠暈勻雲允抎孕𡢘帀雥灾災甾𣅁宰䣬再在𩛥𠵃臧葬鑿早蚤𠴵責夨昃戝𠭯乍柞宅翟㫋占爪㕚召兆䍜肈肇折褶貞栕姫裖振朕震征爭姃正之㞢知隻戠直姪執嬂止旨沚砋黹至豸陟致智彘置雉稚廌疐中終仲妕重眾舟州周洀婤𥂱肘㫶呪冑晝帚朱㦵鼄竹逐𥞏注㤖壴祝鑄叀耑專孨𠨎妝隹追沝墜𣵠酌啄灂茲淄髭子𠂔梓自字胾宗奏卒族祖朘㝡尊左𥙀坐𢼎𠄺𠇦𠊡𠰣𡚱𡚿𡛇𡛏𡜐𡠵𡵂𢀛𢓤𢗦𣏮𣐥𣐩𣲧𣼊𣼓𣼳𤋟𦰩𪜱𪠾𪦷𪦾𪧇𪧭𪪶𪯌𪴶𪷾𪻍𪾏𫅊𫅓𫇆𫊣𫠭𫡜𫢁𫤮𫦀𫦄𫦎𫧖𫨶𫨸𫨽𫩀𫩁𫩐𫩨𫩻𫩼𫪋𫬚𫮩𫯀𫯛𫯦𫰉𫰔𫰧𫲘𫲺𫳅𫳒𫳗𫵴𫸥𫺝𫻨𫻬𫾹𬀈𬀐𬆥𬆬𬇖𬇾𬉖𬍠𬒯𬒿𬙜𬙮𬛧𬛶𬜠𬟧𬟭𬡡𬥢𬪹𬯂𬯪𬯭𬴶𬵃𭅺𭑈𭛵𭶯𮁜𮁧𮇯";
