charset["甲骨文字詁林補編"]="哀安晻按案敖奡巴把罷拜敗般板半苞𤵛背𤰇被奔本皀匕比妣必庇㡀毖閉飶壁髀奰𡚤邊釆變髟表別𨒜賓丙疒并並播伯亳卜𧻷不部才參䝳憯冊長常場朝屮臣沉爯稱成呈懲騬持齒𧙻出初除芻處琡創垂春純茨詞辭此朿刺从從琮叢崔搓達大眔逮代待帶戴丹單亶當蕩倒禱到道稻的登等帝遞諦顛弔釣丁姛動剢督獨讀斷𠂤堆對敦盾多𡖇㘥厄惡遏㖾而二伐法凡笲樊繁返範方祊扉狒𨷹焚糞封逢奉夫𠬝弗孚服畐祓桴箙斧黼赴复負副𠣴腹縛該改敢干旰幹告戈割鬲閤個給根跟庚工肱觥共供遘構古谷股骨鼓瞽冎乖关官關觀管館祼雚灌圭規龜巂鬼簋跪馘果還醢含寒行蒿合和河曷䮤鶴很虹后後乎𠦪狐華化𢦚畫豲豢衁𤠤黃𡐦彗會瘣昏䄆火沎或獲雞羈及吉即疾耤既祭稷加嘉甲假戔肩兼監艱翦簡見畕將疆降郊絞劋皆岊捷睫節解丯借今金僅近進晶頸競糾摎酒𡆥咎就舊䳎罝鞠䳔舉苣據卷夬絕麕攈刊侃看尻咳可勀口寇凷況礦稛來了絫蕾累類離理沴戾蒞歷隸麗聯粱兩燎療廖列烈獵林粦麐㐭廩吝焛陵另騮六龍嚨婁盧虜櫓䜌𦟀履律馬麥髦楙懋昧寐魅們夢眯䍘𥁑娩面廟繆黽名冥鳴瞑墨謀某牡木南夒能孴年念㚔𡴎牛農奴怒盤判旁膨匹痞䑄嬪品牝頗咅璞桼戚期𧒕其奇祈旂乞企啟气器䇂牽掔䙴搴𠨧前亲傾情慶磬囚求虯區取去隺冉攘人飪日戎肉蓐灑彡搔掃瑟沙殺山閃蟺丄上燒勺舌申身神宷審甚祳牲陞聲繩省盛失師十石食時史使宩士示市式似事是視釋收守首狩獸疋叔殊輸秫孰塾黍屬丨㛸樹帥雙水𨿠說司思死巳祀姒肆送嗽夙速㕖餗隨遂𠣬所索臺檀䊤探提體田條通同童銅頭兔彖屯臀橐鴕外宛亡王望為圍壝位胃衛𥁕溫文紋我毋武物寤兮奚犀厀膝熹羲雟習洗係祫下夏鮮鱻咸㬎顯限獻相襄絴亯想餉向象像梟婋小寫榭瀉心辛新囟䏤衅釁星刑形性兇雄熊羞㾋戌需學旬尋詢侚訓濬亞焉延衍陽䍩養夭腰蕘繇要也夜液一郼宜痍疑儀已以亦易昳益異逸意義音殷陰禋斦引㱃印鶯鷹迎熒嬴癭應庸壅永禜用𢆶幽憂尤由友有酉槱又右柚囿祐於畬虞踰予雨圉與玉𡿯遇御毓鬱眢元爰原圓源黿邍肙曰月越鉞樂勻允運帀𢦏灾災宰載再在簪瓚葬鑿早蚤棗造笮擇仄乍翟占璋脹障墇㕚召兆旐䍜肇折䐲褶貞㐱爭正之支㞢只戠止指徵至制治致徝置雉廌製摯中歱種重眾舟周洀盩肘帚朱㦵誅鼄竹逐主𥘭助注祝貯築鑄叀專灷狀迍琢椓斲茲子自字卒祖組籫最尊左作坐𠔉𠰣𣆣𣎆𪯳𪽬𫅊𫐟𫡜𫯀𫹉𫹻𫻺𫾶𫾹𬓏𬔖𬔧𮒣";
charset["簡明金文詞典"]="哀愛安𪛏八白百拜敗班般坂半邦薄保寶報𧇭卑北邶貝僃奔柲匕妣啚必畢鞞璧邊淲賓瀕冰兵丙秉稟並播帛博搏鎛卜𧻷不步才采蔡參倉曹冊側曾差儕㢟長場嘗朝車徹臣辰陳晨偁成丞承乘池㮛遟齒赤敕啻趩緟𤕌寵仇𠃬幬丑出初媰楚畜處嘼傳春純淳錞祠慈此刺賜蔥從誎萃毳虘錯達大𥄳怠丹單擔旦憚𦉜宕道稻得德登鄧狄詆弟帝禘典佃奠琱鼦弔丁鼎冬東董都斗豆堵杜對敦盾多敚奪鐸訛鄂軶而尔爾二罰法番蕃凡樊反返飯方汸妃非篚分奮豐逢缶夫尃旉敷𠬝弗服俘桴鳧福甫斧釜輔㝬簠父付婦傅復腹匄蓋敢干榦高羔鎬告誥戈割歌革格鬲各庚耿更工弓公攻肱恭宮龏龔共冓遘沽辜古谷鼓故顧瓜官關鰥觀盥雚灌光廣圭嬀歸鬼癸簋衮袞𩫏𩫖國虢過還𧽊海亥害邗圅寒行蒿禾合何和河盉𨨛龢黑弘宏侯厚後乎曶𠦪虖壺虎唬許祜華畫淮懷懽寏環荒㞷𡉚𡴍皇黃簧韹毀惠會誨諱昬婚或惑禍蒦霍姬躋及吉即亟姞疾集藉季迹既紀祭㠱誋禝冀濟家嘉夾甲叚間監艱柬簡見建薦諫鑑江姜疆降角教節解戒斤今金䘳瑾饉晉進京荊涇經井敬靜競冋鳩九救舊苴居駒沮筥句具秬虡遽𧇽氒䡈厥絕爵均君軍鈞畯闓𪚕侃康丂可渴克孔恐口寇庫匡媿𦎫剌來𤦃闌牢老㵢櫑羸㵽𠭰釐里裏澧醴邐力立隶歴櫟麗盭斂良梁粱兩量寮蓼尞林粦鄰臨賃鈴霝令柳六瀘鑪魯彔鹿戮露䜌𤔔寽洛吕旅率馬邁曼毛茅卯茂瑁枚眉每妹昧門蒙盟孟迷彌敉鼏免冕廟蔑民皿敃敏黽愍名明鳴銘命末莫謀某母牡姆木牧慕穆乃廼男南難淖內能郳逆年念寧𤕦牛農虐女盤旁徬庖佩配盆朋彭丕皮椑匹辟品甹平撲僕圃溥七期諆其祈旂齊芑杞啟𩒨气棄器千愆前虔黔遣茜喬妾秦禽青卿請慶親邛睘裘區驅𧾱取去趣犬羣人壬妊日戎肜榮柔入芮叡若鄀三散喪山膳商䵼賞上尚少卲舍社射涉赦申身深神沈審慎升生牲省盛聖賸尸邿師溼十石祏時實史矢豕士氏世市似事是室誓手受𠭵壽獸殳叔書淑黍束述庶帥䢦水順朔司絲厮死巳四寺祀嗣㣈松宋訟頌蘇俗夙速肅㒸遂歲孫筍所它荅灘堂匋貣徲天田鋚聽廷通同彤桐童䣄徒圖土團退佗鼉妥外綰萬亡王往妄忘望威微為韋唯違未畏胃衛文問我烏吾吴無五午武勿戊敄夕西昔奚屖錫襲喜舄戲虩下夏先鮮咸賢玁顯縣憲瀗獻相湘襄享饗象簫小孝效頡燮褻心辛訢新信騂型興兄休羞宿戌胥需鄦盨卹恤宣玄薛學纁巡訓訊巽濬言炎嚴郾宴猒燕央羊陽揚怏漾䌁姚䌛野夜業一伊衣匜夷宜飴遺彝乙以弋亦邑易益埶殹異釴逸翌裔意義𢑩億懿音殷陰禋寅䖜尹引飲隱印胤𤸰膺嬴縈郢𩝃應庸鄘雍𩫗永甬用攸幽憂尤猶遊友有酉卣又右于玗余盂俞𦏴𩁹魚逾虞漁䱷宇雨禹敔與語玉聿馭御獄遹儥禦淵元沅爰原員𧻚遠曰月戉礿越樂龠㜏允鄆哉仔宰載再在𩛥瓚造𥨫則責擇夨𠭯乍宅翟盞湛戰章璋昭爪召趙折哲者貞朕烝鉦正政鄭𥂴之祗隻戠直執旨黹徵至志陟智彘疐中忠終冢踵重眾舟州周盩胄朱邾誅諸逐壴祝貯築鑄叀壯追墜濁兹鼒齍子秭自宗走足族祖辠尊左作𢢩𢦔𫁘𫅊𫊣𫎽𫓞𫧻𫩻𫭠𫿙𫿩𬉜𬋶𬎄𬓂𬖯𬛤𬝧𬟰𬰽𬸺𮣋𮥕";
charset["金文常用字典"]="哀愛安八霸白百拜敗班般坂半邦保寶報𧇭卑北貝𤰈僃奔匕妣䃾必畢𢐀㪤鞞璧鞭邊釆𡧍便賓瀕冰兵丙秉并並帛博搏镈𩌏襮卜𧻷不步才采蔡參冊策曾差㢟長嘗鬯朝車臣辰陳晨爯成丞城乘㮛齒赤敕啻趩緟丑出初楚処畜嘼傳春純錞祠此𧧒蔥从誎萃虘逪達大眔𥄳丹單旦宕道稻得𢛳德登鄧詆地弟帝禘典佃甸奠簟琱弔丁鼎定冬東都斗豆𠂤對敦盾多敓奪鐸譌戹咢鄂而尔耳爾伐罰灋番蕃凡䋣反返訉方妃非篚分𩞑奮封𢓱奉夫尃巿𠬝弗孚服畐桴鳧福甫斧輔㝬鬴簠父付婦傅復改匄葢敢干榦高告誥戈割革鬲各庚耿更工弓公攻宫龔巩共冓苟耇遘辜古鼓故寡官關鰥觀雚光廣媯歸鬼癸𣪘簋衮𩫖國聝虢過還𧽊亥害含圅㪋行蒿好訶禾合何和河䢔盉龢黑恒衡宏侯后厚後乎呼曶𠦪虖壺虎唬許祜𢦚畫淮褱環荒㞷𡉚𡴍皇黃璜毀惠會誨𩒳諱或惑禍蒦姬箕躋及吉即亟姞疾集己丮妀忌季迹既祭跡誋加家嘉夾甲叚姦監艱見建薦諫江姜降畺角教節解戒斤今金䘳堇瑾進京荊經井敬靜瀞競冋救㲃舊筥巨句具遽𩰤氒䡈絕爵均君軍鈞畯𪚕侃康丂考可渴克客牼孔恐寇匡媿𦎫剌來𤦃讕牢老勒櫑靁𠭰里豊裏禮邐力立吏隶歷麗盭連斂良粱兩量蓼林粦臨吝霝令䰘龍𧇄盧臚鑪魯彔鹿祿䜌𤔔寽洛閭呂旅率馬邁曼莽毛卯眉每昧門𥁰蒙孟彌敉免廟蔑民皿敃敏黽名明鳴銘命莫謀某母牡娒木牧慕穆乃艿廼迺𢏩嬭男南𪄿内能逆年廿念㚔寍寧𤕦牛農弄諾女毆槃旁徬鞄佩配盆朋倗彭丕皮匹辟闢品甹冖平撲匍僕期諆祈旂齊啟䭫气棄器千前虔遣喬且妾寴秦禽青卿請慶親睘裘區𧾱取去趣䟒犬然人壬妊𠧟日戎榮入𩱨若卅三喪沙山善商䵼賞上尚少卲邵舍社射涉赦申身深神宷審升生牲省盛聖賸尸施師十石食時實史矢豕始士氏世市似事是室冟睗誓収手首受𠭵壽獸殳尗叔書孰黍戍束述庶帥䢦水順司絲死巳寺祀飤嗣送訟頌蘇俗夙速肅雖㒸𠭥歲孫所荅台唐堂匋逃徲天田畋鋚聽廷通彤童䣄徒跿土𢓴屯沱妥外綰萬亡王往妄忘朢𧭅威𢼸為韋唯違未畏衛文聞問我烏吾吳無午武勿戊敄夕西昔奚屖𠩺錫襲喜卌𠦜舄衋下夏先咸閒賢顯縣憲獻相湘亯囂小孝效斆燮㸉心辛訢新信坙型興兄休羞宿戌須需鄦盨卹薛辥熏訓言炎嚴匽郾宴猒鬳昜揚幺繇野夜枼頁業一衣匜宜遺彝乙以㠯亦㚤邑易益埶殹異逸𠶷義𢑩億𢍰斁𩙺懿音殷禋寅𠪚䖜尹引趛㱃印胤𤸰嬴𠈪庸雍饔永甬用𢆶攸幽𢝊憂逌猶游友有酉又右幼囿于余盂𩁹魚逾虞漁宇雨敔與語玉聿御獄遹禦鬱淵元沅爰員𧻚邍遠曰月戉礿越粵樂龠妘允𢦏哉宰載再𩛥造𥨫竈迮則責夨𠭯乍詐宅湛戰章璋盄爪召肁趙肇折哲者貞朕敶𨒌整正政鄭𥂴之祗隻侄執止旨黹至志陟智中忠鐘歱重眾舟周冑朱誅諸鼄逐䰞壴祝鑄叀隹追茲緇鼒齍子自字宗走足族祖辠尊𠂇左作㚄𫁘𫊣𫜘𫭠𬄜𬓂𬚬𬚮𬛤𬦘𬨭";
