charset["侯馬盟書文字編"]="嗌安盦𤼧白百邦卑誖匕比𨚍𨚓愎觱璧弁爂賓疒並誁卜不艸䘍產臣呈逞𩛦丑出處牀趠此從大待丹鄲旦道惪隥迪氐邸弟墬簟弔鼎定都犢綐而餌二伐非朏𢓱奉夫弗茀畐輔父复復富腹𠣾改絠甘敢睪公宮狗沽蠱固㽽歸鬼癸𢧩過邯韓𢔔行盇盍黑矦後𨒥虖𤶘嘑㦌𤞙𨛵𩡧繯奐㞷𡉚𡴍皇悔諱慁或丌圾及吉亟疾㥛𠮯𡧯既嘉甲駕見角𤶀敽結今晉盡井坓赳豦勪君侃可寇狂䖯䞨老吏利良梁兩料㭩焛𠳄令柳麻馬罵買賣卯没每盟孟迷𧠟糸名明榠命𩓔某木內逆鳥寍牛女𥧆平莆圃其邔𨙬牽愆𨝍諐𢍱欠喬𨝱妾秋區敺拳犬羣群人仁入訯卅僿殺尚韶少卲邵𨛍舍身罙阩省十石識氏事是室筮𥰰守𣐌書庶豎帥䢦司死寺宋蘇隋𥝩孫所它臺堂䤾討体惕通緰頭徒㥆佗亡往𢼸為韋爲文聞巫吴無五午勿西息奚覡喜郤先㬎顯獻肖痟詨心新興兄卹恤言郾𪒠昜陽冶一夷宜乙以㠯攺耴痬義𢍰繹寅釿瓔應癰永甬𧻹用𢆶猶友有又侑姷于余禺俞魚與𡩗諭元爰怨月汋樂𣫞鑿喿則痄旃章涱趙悊𣚅者政之直值執植至志陟彘廌質中冢重衆胄朱竺宔助祝鑄茲𧿞䖪子自字宗族詛䢷𠡎𣣆𣳑𤼈𪬺𪯋𫊣𫎘𫏺𫭠𫭰𫲨𫹳𫻪𬋧𬙮𬨲𬪆";
charset["侯馬盟書字表"]="嗌安盦𤼧白半邦卑𨚓丙並卜不䘍產臣呈城逞𩛦丑出趠此從大待丹鄲旦道德登隥狄地弟簟定迵都綐堕而餌二伐非朏丰逢奉夫弗茀輔父復富腹改絠甘敢剛睪公宮狗沽蠱固㽽歸鬼癸衮國亥邯韓行盍黑侯後虖嘑㦌𨛵䭴繯奐皇悔諱婚慁或及吉亟疾𠮯既嘉甲駕見角𤶀結今晉盡井駒豦勪君侃可寇狂䞨老利林焛令柳寽馬罵買卯每盟孟迷𧠟明命𩑦𩓔某木內尼逆㚔寍牛女𥧆丕平莆其䙴諐喬妾秋區敺犬群人仁入三殺尚少邵舍身兟生阩十石史氏似事是室𥰰守首叔𣐌書豎帥䢦司死寺宋蒐穌𥝩孫所台惕通緰徒亡往𣁋為爲文巫烏吳無五午勿西息覡喜先顯獻肖痟詨心新𤶲興兄卹言詽郾昜陽瘍枼一夷宜乙以耴繹音寅釿癰永甬𧻹用𢆶猷友有又侑于余禺俞魚與玉遇諭惌元月樂鑿則擇痄章涱詔趙者正政之直執植職至志彘廌質中冢重眾冑朱竺祝貯馵鑄𧿞子自字宗族𠡎𣣆𣳑𤼈𪫽𪬺𫊣𫏺𫲨𫵁𫹳𫻪𬙮𬨲𬪆𬱈";
charset["侯馬盟書字表新編"]="嗌安盦癹白邦卑匕比𨚍𨚓璧𧥑弁丙並竝誁卜不蠆產臣成呈逞𩛦丑醜出處趠此從大待𤸊丹鄲旦道惪登隥邸地弟弔定都閗犢綐而餌二伐非丰逢奉夫弗茀輔父复復富腹𠣾改絠甘𠭖敢睪公宫宮躳狗沽蠱固㽽歸鬼癸𢧩衮國過亥邯韓𢔔行盇黑侯矦後虖嘑㦌𤞙𨛵槐𩡧寏繯奐㞷𡉚𡴍皇悔諱婚慁或丌箕及吉亟疾㥛𠮯既嘉甲駕見角𤶀敿結今𦘔晋晉盡井坓駒豦勪君侃可寇狂䞨老吏利良梁兩㭩林焛令柳寽麻馬罵買卯每盟孟迷𧠟明榠命𩑦𩓔某木𩵦內逆鳥寍牛女𥧆平莆其䙲諐喬妾秋區敺驅犬羣群人仁入三殺尚韶少邵𨛍舍身生阩眚十石氏似事是恃室筮守𣐌書豎帥䢦司死寺宋蒐隋𥝩孫所台臺忒惕通緰頭𨑒徒㥆亡往𢼸為韋爲文巫吴吳無五午勿西卥息奚覡喜㬎顯獻肖痟詨心新𥃘𤶲興兄䘏恤言郾𪒠昜陽瘍一夷宜𢓡乙以㠯耴繹音寅釿雍癰永甬𧻹用𢆶猶友有又侑于余禺俞魚與玉聿遇𡩗諭惌元爰月汋樂𣫞鑿喿則擇戝𠭯痄旃章涱趙悊𣚅者正政之直執植職至志徝彘廌質中冢重眾衆胄朱竺宔祝貯𧿞䖪子自字宗族詛𠡎𣣆𣳑𤼈𪫽𪬺𫊣𫎘𫏺𫭠𫭰𫲨𫵁𫺛𬋧𬙮𬨲𬩳𬪆𬱈";
