charset["上海博物館藏戰國楚竹書(八)文字編"]="㤅安白敗邦保備比俾必佖薜壁覍冰秉不才材藏惻𢝔曾差昌倀長繛朝臣爯城乘𨌤恥齒啻虫蟲𦅅楮楚畜春萅綽詞慈此從𡪣達答大𠱾紿旦逿道得悳德迪氐奠𨗛冬𣅈東豆瀆斷多蛾䖸譌餓而尒二弍法灋𨑓樊膰㸋反方芳訪非飛風否夫尃㭪弗父復改𠭖𢽤榦高睪膏鎬告割茖各公攻宮躳沽柧古谷官關觀毌雚光國果過還𣳠海害含寒汗行好合和𠄨恒後𨒥乎許華緩𦅻𡉚𡴍皇毀會𣌭昏或丌箕級集雧幾忌𢗏𢗹既紀稷家幵戔柬見𨟻醬膠絞教皆節解戒斤今𦘔進𡩻盡腈精敬靜咎就凥居𣻐沮悁夬氒君可孔口寇來蘭勞老厽頪李豊力立朸利㮚𣡷萰良粱流𣹳六婁螻魯彔鹿路露䜌𤔔亂𠧎𠧏洛𩂣郘慮馬澫茅門䛑蔑𧀅𥣫民名明朙命莫母木目𥃦乃𦑴難𪄿內能迡逆年秊鳥諾女旁彭翩貧甹僕七亓其奇𦸗齊旗起啟臤僉前歬強勥且秦鈙青寈情請親窮竆求裘取𨓭去迲趣逡羣群肰然讓人仁忎任日蓉辱入三色善譱商尚卲舌蛇舍社𥙭身𥥍深神宷審甚慎生𦖞眚聖失十旹食時世事侍是室視𢝬收受售獸書黍蜀丨束述庶樹厶司思斯死巳四寺䇃飤竢宋穌速歲所索它體天聽廷同桐童荼徒圖𩠹退𢓴佗外萬亡王网往迋愄韋唯偽愇韙未胃衛昷䎽聞我𢦠烏毋吾無𣞤五勿夕西昔㫺枲𢝫憙下夏先閒賢獻相心辛忻囟信秀須選亞言昜也頁一衣遺以㠯攺矣亦埶殹異逸因欽尹𩚧浧雝俑攸忧幽猶遊游猷友又幼於于余羽雨㼌與芋欲𣁎豫囦淵元員𪔅遠願曰約月𠯲𨒋越樂澡喿則昃𣳤章𦩻詔折㭙者正㱏之隻戠植止旨枳至志智疐𣉻中忠重眾周助壴䝬箸狀子自縱走足族罪辠作坐𤇈𪲓𪴿𫊟𫐩𫔢𫜢𫩞𫹵𬁡𬚆𬛤";
charset["上海博物館藏戰國楚竹書(九)文字編_陳茜"]="㤅愛安八𤼧白百拜敗𢱭邦保備誖𢨋必閟幣賓秉并波犻卜不才厠策廁惻曾差倀長嘗車臣陳爯成城乘珵𨌤赤遚出𩸍楚畜汌串𥿆詞此𧙕從䱜達大𠱾逿道㝵𠭁得悳地帝殜冬凍斷鈍敚訛而尒餌𩱓二灋𩑱凡𨑓反方訪非飛肥分焚燓奮奉夫尃𢾭弗伏郙父婦復𠭖敢高睪告割茖各公攻恭宮共㝅古谷鼓𣖫固寡冠雚光䢜龜歸鬼貴䞈果過還害含行合和河曷盍𠄨恆訇矦厚後𨒥虖虎許緩𦅻患黃隓悔𩲡卉𣌭或禍𥛔丌吉疾季既紀祭㡭加家嘉夾賈𧱌幵𨳿監柬見建漸諓𣿕江𨟻𨡓醬教皆𦁉滐介戒今金𦘔晉進京敬丩九咎就凥居句懼夬絕矍均君軍𧥺開𢧆可客哭狂悃困邋來倈勞老厽李里力立吏利連兩列臨吝霝令蒥𣹭魯鹿𤔔亂𩂣鵅呂率馬澫𧠑覒美媄門免㝃民名明命末莫寞墨𢘓謀母木乃𦑴難𪅀内能逆匿年寍女𣏟伓伾𧯿鼙𨳟闢甹平坪莆僕七亓齊旗𢼄起啟气弃䏠棄器千臤前遣戕強喬禽青請慶丘屈區佢瞿曲取去迲人紉日若賽三色殺山善譱賞上尚少申身穼堔深紳甚慎生繩聖失𢻱𢼊十溡史士氏世事是室視𢝬適澨𦣻首受獸疋蜀㣽𡊍述恕庶豎䢦𧗿霜水舜厶司思斯死巳四寺飤駟訟䛦叟叜歲所它台湯棠𨒗惕天田畋𦀚䋼同童徒涂兔退𢓴屯𨒙外亡王𤣴𡔞往𨓹忘望為唯爲未胃文䎽聞問𨳮我烏毋吾無五武勿西希昔習憙謑𠤬綌柙下先閒臽相亯向囂斆心新囟信興兇須學巽言檐弇酓卬堯要也鄴一弌夷以㠯矣弋亦邑役易埸埶殹尹飲㱃憖郢甬勇㦷攸幽猶酉又右於陓于汙余釪魚与禹㙑與語玉聿浴欲御獄囦淵員遠曰約月樂䢵帀灾栽烖載則𠭯宅沾占輚戰𡃣漳𠧞厇折㭙者貞鉦整正之隻執止旨至志智𡡘𣉻𥏼中鐘衆州侜周敳宔祝耑隹追迍子自宗總族辠左𠉹𠏴𠝻𡠦𡵂𪴿𫊟𫑠𫜢𫢁𫩞𫪆𫲪𫻴𫾽𬂴𬒬𬓇𬚆𬚋𬠤𬡤𬢭𬪝𭧝";
charset["上海博物館藏戰國楚竹書(九)文字編_李敏"]="㤅安八𤼧白拜邦保備必閟賓秉并波犻卜不才策廁惻曾差倀長嘗車臣陳城乘珵𨌤𨍱𢕌赤出𩸍楚畜汌詞此從汆䱜畣大逿道㝵𠭁惪帝殜冬凍鈍敓訛而餌二弍灋𩑱凡𨑓反方訪非飛肥焚奉夫尃𢾭弗伏扶郙父婦復敢高睪告割茖各公恭宮共㝅古谷鼓固寡雚光䢜龜貴䞈果還害含行和河曷𠄨矦厚𨒥虖許緩患黃隓𩲡卉𣌭或𥛔𣪠畿吉疾季紀㡭加家嘉夾叚𧱌幵𨳿監柬見漸諓江𨟻教皆𦁉滐介戒今𦘔晉進晶敬丩九咎就凥居句懼夬均君軍开可客哭狂困邋來倈老里力立利連兩倆臨吝霝令蒥魯鹿鴼𤔔𩂣呂馬澫𧠑門㝃民名明命末莫寞墨𢘓母木乃𦑴難內能逆匿寍女𣏟伓𧯿𨳟坪僕七戚亓齊𢼄啟气棄𢞒器千臤前遣戕喬青請親屈區取迲人日賽三色殺山善賞上尚少卲申罙深紳邥甚慎生繩聖𢼊史士氏事是室視適首受獸疋𡊍述庶䢦霜水厶司思斯死巳四寺駟䛦歲所它棠𨒗惕天畋𦀚亭同童徒圖退屯𨒙外亡王𤣴𡔞往忘為唯爲未胃䎽𨳮我毋無五武勿西昔習憙謑綌下先相向囂心囟興兇修虛須學巽檐酓卬堯要也鄴一弌以㠯矣弋亦邑易殹逸㱃憖郢甬㦷幽猶又右於陓于汙余釪魚与㙑與語玉聿浴欲御獄員遠約月樂䢵帀栽載則𠭯沾占戰漳𠧞厇折㭙者貞鉦正之隻止旨至志智𠌹𡡘中鐘重眾衆州侜朱敳宔耑隹迍子自宗走𣥕族辠左𠉹𠝻𡵂𪴿𫊝𫊟𫑠𫜢𫢁𫩛𫩞𫲪𫻴𫼄𫾽𬂴𬒬𬓇𬚆𬚋𬠤𬡈𬡤𬢭𬨤𬪝";
charset["上博藏戰國楚竹書字匯"]="哀𢜺敱㤅嗌賹安侒芺㤇犮茇癹𩖽白百拜敗班板邦邫塝保𡧰珤飽緥賲寶豹暴卑悲北貝备倍被備本迸比俾必佖閉閟蔽幣璧鞕鞭邊弁𡧍𡭪便蔈表𧜫䘷賓兵秉怲柄并病竝波帛泊胉𩐟𦆿卜㙛不布䌨才材采菜參蠶倉蒼滄藏操曹冊側測惻曾詧察䐤廛纏產昌倀長腸巢朝樔車偖臣迧陳㫳晨爯成承城乘𨍱蚩鴟池𡊆𨒈馳遲恥齒褫敕啻憧𦅅寵薵出初楚畜䜴川傳牀春唇趠詞慈此賜從啐毳𡪣虘措䱜迖達大代𦬊𠱾怠帶丹酖旦但憚宲道𠭁得悳德登等氐砥地弟𨑩俤帝諦奠弔訋殜丁鼎鼑定冬東𥳘迵侸都斗荳逗梪䛠䈞杜度斷兌多敓敚鐸椯憜莪譌惡噩恩而尔耳迩餌薾二伐罰法灋番凡𨑓𥿋䋣反𨊠飯方枋非飛𦄂肥芾分芬枌焚忿奮封風僼豐奉缶否夫肤尃膚𧀴弗甶芙孚浮福𧸌𠤳甫𢻬府俯釜䩉父付𠇑坿赴复負婦復富腹賦縛𠓗伽改概甘攼竿杆敢干倝淦榦贛剛𩓙高羔睪告誥圪袼割革茖鬲㦴葛各根艮庚耕賡縆工弓厷公功攻恭宮躳龏巩共佝狗耇枸訽㝅詬沽孤姑古谷骨𦙶蛊鼓固故㽽梏顧苽䏦寡官關鰥𥍊觀管冠盥雚光廣圭珪䢜𧠹閨龜𠐦歸鬼癸貴跪䞈郭𩫏國果裹過還𣳠海害含肣寒旱𢽎行𧗟蒿好翯訶禾何和河盍㥺𠄨恒衡蘅訇鴻𥎦侯后厚後𨒥虖斛虎許戶㭉華畫淮褱懐懷坏懽緩奂奐宦豢巟𡉚皇黃隓回悔毀毁卉晦惠會詯誨慧譮𣌭昏惛火或貨惑禍𥛔𢡺雘穫丌𡉝飢基𣪠機及伋吉汲忣即急級疾集𠹋覿己𠮯幾擠忌𢗏季既紀祭悸㠱裚禝稷繫繼加家嘉夾甲叚賈𧱌幵戔肩兼堅監柬見建漸賤踐㵎薦諫江疆降𨟻畺𨡓交焦𤓪角佼𡥈教皆菨階湝𣳟桀訐傑結節滐解介戒繲斤今金衿𦘔䘳堇緊槿謹近晉𡥨進寖京晶腈經精井坓汬頸逕徑桱敬靜競朻鳩九咎救就舊居巨句具虡聚愳懼倦悁絭夬氒決絕蕝爵𨼱均𦬩君軍鈞𡋴剴慨嘅檻康尻考攷𧃼可克客𢖶恐口敂寇桍哭苦俈庫絝瘔𠇗誇匡狂𢚇窺楑困𦎫剌來逨勑勞老雷𩂩厽纍頪類里𨛋豊力立朸吏利㕸戾莉𠪄厲礪連憐斂良梁粱糧兩量列林𠳵𠵂鄰臨吝陵霝流蒥𨍸六龍𡃡婁蔞謱魯坴彔陸𢮑鹿翏路𣩍戮露鑾卵𤔔亂𡄹綸輪𥚰羅蓏洛𩂣呂旅履縷緑綠慮麻馬曼澫䡬芒尨毛茅嵍眊冒𢘅𧠑沒玫每媺妹昧眛寐門悶盟孟夢迷䛑蜜免㝃冕面䁧廟烕滅蔑𥣫民緍泯敏閔名明榠鳴瞑命磨末𠬸莫寞㱳墨縸纆𢘓𧦥呣𢜯母拇畝畮木目牧穆乃𦑴男南難戁內能尼坭倪貎柅𣅸屰迡逆匿溺年㲽念鳥㘝聶孽蠥寧𤕦牛農辳槈奴瘧諾女怕𢘣𣏟攀盤𨒃𦡊㯱倗堋𨋊彭伓𢻹皮埤匹諀辟貧𦬑坪缾𤽐僕普暜𩑀七𣅔妻淒期慽緀其奇祈耆齊旗㽯芑起啟𩒨气弃泣咠氣葺棄槭器薺千臤孯僉前朁蕁㦿遣倩強牆勥喬僑且妾侵秦琴禽寢沁青清寈輕情請慶親睘窮丘秋囚求酋梂賕𨒡屈驅佢曲取𨓭詓去迲趣㒽全惓湶𤷄權畎𩫠雀鵲羣群肰然䑋讓人仁𡰥忎忍任衽釰辸𠧟日馹戎容融柔䐓肉如䋈辱㪫閏若弱洒塞賽三㪚㪔散喪㿋色瑟嗇㥶濏殺山羴善商傷賞上尚少邵舌舍社射涉設𥙭身𣢘深紳神沈矤𧧍審甚慎生阩𥘥牲陞𦖞省眚𦔻盛勝聖失屍詩十石時實識矢豕使士氏市式事是适𣳪室眡視𢝬筮適奭噬收手守𦣻首受壽獸疋𥿇舒疏暑蜀鼠束㣽述庶樹衰𧗿水順舜碩厶司思斯絲㴲死巳亖四寺祀䇃泗飤洍嗣㣈松宋送訟頌夙𡖊速𠉦肅𥝩𥥇遂歲誶孫所索它台臺𦬫怹貪灘埮袒炭𦳝湯堂棠糃滔匋逃桃慝剔體惕𢞫天田畋佻覜𦀚䋼聽廷同童僮穜𧺔𡌘徒涂圖土退屯𦞠𨒙䡐妥𩂡外萬亡王枉罔往𢓸𢼟𨓹忘望危威𣁋葳愄為韋唯惟爲違尾葦愇緯未味畏胃衛昷𥁕文䎽聞我𣇫烏毋吾吳無五伍迕武俉𨾟憮勿戊務𠊮雺夕西昔析𣂔奚屖傒溪席習𨻋隰飁襲徙憙係綌虩䀌柙舝下夏先鮮弦咸閒賢㬎險顯莧粯縣獻相香鄉𩾬享亯𦴒向象𨞠䟁囂洨筱孝笑頡禼褻心忻訢新囟信星刑型幸興凶兄兇休宿秀虛須需俆𥅺卹叙敘蓄續宣軒愋玄选薛學血旬尋𥶳訓訊巽遜牙𤘈亞延言炎琂訮𪉟顏嚴鹽㕣掩酓𥰃牪晏𤞣雁𧧑燕諺䳛央羊昜㦹卬𢼝養恙羕肴堯䌛宎要窔藥也埜野夜頁偞葉一伊衣依𠤕宜迻巸疑頤以㠯矣偯㰻弋亦邑役易佾㑥埶異逸㓷𠶷義𢍰因侌音㸒淫寅欽尹㱃印䚿英褮盈桯滎蠅郢浧𠈫雝甬俑勇埇㦷𥿽用𢆶攸忧幽𢚧憂蚘遊游猷友有酉卣又右幼於陓于汙余𠈌禺竽俞𩁹雩魚堣逾愚䰻与𢌱羽雨禹敔萭㙑與語藇㦛玉芋聿𢌻浴欲遇御愈獄慾豫譽囦淵鳶元芫爰原員厡𧻚蒝圓邍𨙅遠夗曰約月戉樂云囩允隕孕愠運慍帀𥘔災哉栽載𠵃臧贓早蚤趮躁竈迮則責擇䕉澤昃𤶑戝賊增憎矰贈𠭯樝乍齋宅詹瞻占戰𡃣章暲丈障𠧞狣詔厇折悊𣚅轍者貞砧蓁䊶朕誫敶㯢征爭氶正政證之支只枝脂直執植止旨枳徵至志制桎智雉廌疐䉅懥中伀忠終鐘重眾衆媑舟州周胄晝株竺逐宔渚煮壴祝砫䝬箸耑灷妝壯隹椎酌茲䊷孳訿資緇子杍姊自字宗縱走𣥕足卒族㵀俎祖組𥛜罪辠尊左作坐怍祚練﨤㑆𠈖𠐠𡋕𡌆𡧛𡧳𡵂𢗞𢚡𢛸𢣭𢼆𢽍𢽙𣆣𣎆𣾴𤜪𪞿𪟊𪠖𪢽𪣬𪧕𪧧𪪋𪫰𪫳𪬴𪭉𪭍𪱞𪲇𪲓𪴿𪺞𪾇𫃦𫊟𫊣𫌣𫌲𫎕𫏳𫐡𫔢𫜢𫞫𫢁𫦂𫩞𫮙𫮮𫲪𫲹𫳊𫳋𫳝𫴄𫴒𫵖𫹵𫺜𫻴𫻶𫼄𬅸𬅻𬆁𬋧𬌍𬍧𬏄𬐇𬐻𬑭𬒬𬓂𬔓𬔢𬚆𬚋𬛊𬠤𬡤𬢙𬣏𬥦𬨠𬨤𬨧𬪌𬪟𬴥㭉";
charset["上博楚簡文字聲系(一-八)"]="哀㤅嗌愛𢟪賹安侒芺奡犮拔茇癹𩖽白百拜敗班阪板邦𦢊保珤賲寶豹暴卑悲北貝𢻵备被備本迸𡎾比俾必佖𣥣閟鞁幣薜壁𦿝璧𠓥鞭邊弁便辯蔈表𪊬䘷鱉賓冰兵秉怲并並病波帛泊胉𩐟𦆿跛卜㙛不布才材采㥒菜參蠶倉蒼滄藏操曹冊測𢝔曾垞差䐤㢟廛纏產昌倀長腸朝樔車偖徹臣迧陳㫳爯成呈承城乘𨍱蚩鴟𨒈馳遲恥齒啻憧虫蟲𦅅寵薵出初楮楚畜處觕嘼川傳串牀春唇綽祠慈此賜聰從爨啐毳𡪣虘䱜達大代𦬊𠱾丹酖旦但憚逿道𠭁得惪德登等迪藋氐砥地弟𨑩俤帝諦奠弔訋殜𨗛定冬東𥳘迵都豆荳逗梪䛠瀆暏䈞杜斷兌多敓鐸椯莪蛾譌惡餓噩恩而尔耳爾餌邇二弍發伐罰灋番凡𥿋緐膰反𨊠飯方芳枋訪非飛𦄂肥芾分芬坆枌焚忿𡊅奮封風僼豐奉缶否夫肤尃㭪膚𧀴弗芙孚浮福𧸌𠤳甫𢻬斧䩉父𠇑复婦復富腹賦縛𠓗伽改槩甘攼竿杆敢干淦榦贛剛高羔睪膏鎬告誥圪割歌革茖鬲㦴閤葛各鉻根亙艮庚耕賡緪工弓厷公功攻肱恭躬宮躳龏巩共佝鉤狗耉枸訽彀沽孤姑柧古谷骨蛊鼓蠱固故梏瓜苽䏦寡官關鰥觀冠雚光圭珪𧠹閨龜𠐦歸鬼癸蟡貴跪䞈𩫖國果裹還𣳠海害肣寒汗旱焊行蒿椃好昊䚽翯訶禾何和河盍恆衡𢤀矦厚後𨒥胡斛虎唬許滸戶㭉畫話淮褱懷懽瞏緩奐宦豢巟㞷𡉚𡴍皇黃隓回毀𩲡卉惠會詯譮𣌭昏惛火或貨禍𥛔𢡺穫丌𡉝基毄機及伋吉汲即急級疾㥛集覿己𠮯幾忌𢗏季既紀祭悸惎裚禝稷繫加家嘉夾甲叚賈𧱌幵戔肩兼監柬𡑯見建漸賤澗薦諫𣿕江將疆降𨟻畺醬交焦膠角絞𡥈教皆菨階湝𣳟桀訐傑結節詰滐解介戒疥繲斤今金衿𦘔䘳堇緊槿近晉浸進𡩻京腈經精井坓汬頸徑桱敬靜競朻鳩九咎救就舊匊居𣻐蓻巨句具虡聚懼涓劵倦絭夬氒決絕蕝𢇍均𦬩君軍鈞剴嘅侃檻康尻丂考攷可克客肯孔𢖶恐口敂寇哭俈庫𠇗快狂楑愧䖵困𦎫剌萊逨勑蘭勞老雷𥇬羸藟纍頪悡𨤭李里𨛋豊力立朸利戾莉栗厲礪連廉𨏶斂萰𧸘良梁糧兩量列洌林𠳵𠵂臨吝賃陵霝流蒥𨍸六𢞭龍嚨𢤲聾婁蔞螻謱魯坴彔陸𢮑鹿翏路戮鴼鑾卵亂侖綸輪𥚰羅洛𩂣吕郘旅履縷緑慮勴馬曼澫䡬芒尨毛茅眊冒𢘅𣔺貌㺳每美媺妹昧眛寐門悶𥁰䀄𣏍孟夢眯迷䛑蜜免㝃𡧊面廟烕滅蔑𥣫民緍泯名明榠鳴瞑命磨末𠬸莫寞㱳墨縸纆呣𢜯母拇畝畮木目牧墓𩵦穆郍乃柰𦑴男南難戁內能尼坭倪柅孴屰迡逆匿溺年念鳥聶𤕦牛農辳槈奴瘧諾女𢘣𣏟盤蟠鞶畔𦡊旁㯱倗堋彭伓𢻹皮埤匹諀擗辟貧品𦬑坪缾敀菐僕七妻淒期緀慼其奇祈耆𦸗齊旗臍𧰙㽯芑起啟䏿𩒨气泣咠氣葺棄器薺千臤孯僉𩓎歬朁蕁錢㦿淺遣譴倩墻喬僑且妾𢿑侵秦琴鈙禽寢𦊶青卿清寈情請慶親窮竆丘秋叴求酋逑梂賕𨒡屈詘驅佢㲘曲取𨓭詓去迲㰦趣全泉惓湶𤷄權𡿨畎𩫠雀鵲逡群肰然䑋讓人仁𡰥忎忍任衽辸𠧟日馹戎容蓉融柔䐓肉如辱叡閠若弱箬塞賽三㪚散喪㿋色瑟嗇銫㥶濏殺山脠羴善商慯殤賞上尚裳少卲舌蛇舍社射涉𥙭申身罙𣢘深紳神沈審甚慎生牲陞𦖞鼪眚𦔻盛勝聖失屍詩十石時實史矢豕使士氏示事侍㳏是适室眡視𢝬筮適𡚐收手守首受壽獸疋𥿇舒暑蜀鼠丨㣽述庶豎樹衰䢦水舜碩厶司思斯絲㴲死巳四寺祀䇃泗飤洍嗣㣈松宋送訟頌夙𠈇速肅𥝩遂歲孫蓑所索它台臺𦬫貪灘埮袒炭𦳝湯棠糃偒慆匋逃桃慝體惕替天田畋佻覜𦀚聽廷庭通同桐童僮穜荼徒涂塗土兔退屯豚𦞠𨒙佗沱紽䡐駝妥𩂡外宛㽜惋萬亡王网枉罔往忘望𧨉危威𢼸葨愄為韋唯惟爲違尾偽葦愇椲緯未味畏胃渭衛𥁕文聞我握臒烏毋吾吳無五午伍迕武俉憮勿戊敄務雺夕西昔𣂔息奚屖傒溪犧席習隰飁襲徙𢝫歖係綌戲柙下夏先鮮㳄弦咸閒㬎險顯莧陷縣獻相香𩾬亯𦴒向巷象䟁囂洨筱孝笑頡禼褻心忻訢新囟信星型幸興凶兄兇𧧗休𦾈宿秀虛須需徐卹敍敘絮蓄續軒玄璿选選穴學血旬尋訓巽遜濬牙亞言炎琂詽顏嚴鹽弇酓𥰃牪晏猒𧧑燕央羊昜㦹諹卬養恙羕夭祅腰肴堯䌛舀要窔藥也埜野夜頁偞葉業一伊衣依宜𠤗迻巸遺頤以㠯矣㰻弋亦邑役易佾貤埶殹異逸㓷𠶷義𢍰因侌音㸒唫淫欽尹㱃胤䚿英婴𨿳𧭭桯滎縈郢浧𠈫甬俑埇㦷𥿽用攸忧幽𢝊憂由蚘猶遊游友有酉卣脜又右幼於于汙余盂𠈌禺竽俞雩魚堣逾虞愚䰻与羽雨㼌敔㙑與語藇㠘玉芋聿浴欲遇御愈獄慾豫儥譽鬻囦淵鳶元芫原員𧻚遠肙曰約月戉𨒋悦樂云囩允隕孕愠帀𢦏𥘔哉栽宰載再葬早蚤澡喿趮竈迮則責䕉澤昃𤶑賊增憎矰贈𠭯樝𠓣乍齋宅詹瞻占𡃣章暲丈𠧞䍜厇折㭙悊𣚅轍者貞砧蓁軫朕誫㯢征爭𢾷正政之只隻戠直執植止旨枳至志桎智廌疐䉅懥中伀忠終重衆媑舟州周晝株竺逐敳燭宔渚煮壴祝䝬箸築𥴀耑剸塼𠨎妝壯隹椎酌茲兹䊷孳訿資緇子姊自宗縱走足卒族㵀俎祖組𥛜辠左怍祚㑆𡊔𡋕𡌆𡧛𡵂𢚡𢛸𢣭𢽍𣏤𣗥𣥜𪞿𪟊𪠍𪠖𪢽𪣬𪧧𪫳𪭉𪭍𪲇𪴨𪴿𪺞𪾇𫄏𫊟𫊣𫌣𫌲𫌻𫎕𫏳𫐡𫔢𫜢𫢁𫩞𫭠𫲹𫴄𫴗𫵖𫹱𫹵𫹹𫺤𫻴𫻶𬅸𬆁𬏄𬐇𬑭𬒬𬓂𬓚𬔢𬗧𬚆𬚋𬛊𬛤𬡤𬨤𬨧𬪌𬴥㭉";
charset["吳越文字彙編"]="安癹白百拜敗保寶卑北啚𠨘弼賓秉帛搏不才參倉艸冊曾差產長臣辰爯成承城鋮逞赤啻𠃬初處川船春此次賜從大𣱼惪悳登弟帝弔鑃丁鼎定脰多而兒二發伐凡繁反焚夆夫尃𢾭膚弗畐父复敢倝戈各亘庚賡工公攻宮龏鉤沽姑古鼓𠯑盥光銧貴亥邗㪋𢽎行禾和龢侯后後華㞷𡴍皇悔湏會丌姬䛴及吉汲戟季既旣稷戔監柬減建薦鑑江疆今金𦘔堇涇敬丩九居句䀠虡氒君康丂考可克客孔俈匡剌勞釐立利連良梁㐭鏐翏麓羅濼呂旅鋁矛盟鼏民鳴命莫𩑦𩓔母穆乃南內惄年念槷寧女𧦃盤旁配堋皮辟平坪裒期𡢁其祈旂齊器僉鐱虔淺戕且青清慶丘秋叴訄曲然冉人日戎入汭叒若喪商賞上尚卲舍生師十史士氏是恀睗受壽書孰黍庶水順巳四寺姒飤夙歲孫台貣天田條同䣄徒土外萬亡王往忘威為唯爲維委聞我吾吴吳無五午武兀勿𨨡夕西下先𡩜相亯囂孝協新釁姓興兄休吁續玄鉉學愻煙嚴酓妟宴鬳昜陽揚羕夭野枼医匜宜𡱐乙以㠯亦益埶逸義𢍰陰尹釿英永甬勇用友有酉又右於于余䱷敔御禦淵元𧻚曰月戉岳樂云允帀哉則𠭯𤈩乍宅召哲者貞朕鉦正政之祗隻直植旨至志中終鐘冢州朱宔祝鑄叀灷壯隹孜姿玆子紫自字宗怍𪭓𫊣𫑛𫦊𫩞𫻮𫻹𬅞𬙮𬬚𬺡";
charset["新蔡葛陵楚簡文字編"]="哀𢜺安䢿𡎑八犮白百拜邦𨛁保𡧰寶北備必畀髀璧賓丙竝𤜧駁卜不步才𥚸倉鶬冊惻差長常臣辰陳㫳成城乘𠅞𩫨𨒈遲𨛅赤啻瘳丑出楚䚒愴萅犉惙賜從虘𨛏達大𠱾丹禱道得悳德地蒂蔕甸奠𥾯殜丁定冬𣅈斗逗瀆堵䈞兌多敓訛蛾𧒎譌而荋珥爾二發凡𨑓緐橎反返方邡芳紡渄肥𩞑焚奉夫鄜豧膚弗甶郛浮福甫㝬父復腹敢𪉿贛高睪告郜割茖各庚賡更公攻䢼躳㝅孤姑古羖盬𪉶固關觀珪䢜龜歸鬼癸果還亥害行毫合𠄨恒矦後𥙝𩢪唬戶瀤酄豢黃璜隓禈回恚惠蕙𣌭昏火或禍𥛔穫丌及吉疾集雧己既𡨁祭稷佳珈嘉甲𧱌𨳿柬梘見建薦江繮𨟻角𤶳皆𣳟結解戒疥今𦘔紟䋮晉經敬競九咎救就舊凥居痀䢹句倦均君康穅苛可客𢖶恐口枯饋剌逨藍牢勞老驪李里豊力利栗連良兩林臨吝𠳄陵霝蘦留瘤騮六龍礱婁蔞臚彔鹿麓𦟀羅𦣇洛笿梠𠜈馬芒尨卯冒𩫁𦿗門鄳麛弭命末莫𡖶墨某母牡木𣉘𦑴南難內郳牛女𣏟肧配彭伓郫闢坪鄱七𣅔慼亓旂釮頎齊起䭫孯䙴遣𤷰羌喬禽青卿慶睘窮竆丘求㤹裘屈取去泉觠犬券人壬辸日融若𥤧塞賽三喪山脠善殤上尚少邵社𥙭申身神邥甚生牲盛聖師食時氏事是室視筮𥰰手首受壽疋黍束述水祱司思死巳四寺飤洍宋穌素速算祟遂歲孫𢿃所它台灘體天田盷𦀚同彤桐童途迌䜝屯佗外玩贎亡王為韋唯爲𥯤未胃衛文䎽聞我巫嗚毋吳無五午武勿戊𦄝夕邜西昔屖悉傒𦞽溪犧習徙喜憙虩舝下夏先閒𢚀憲獻相亯潒囂小詨心辛忻新𩥍休戌虛暊詡卹敘續嬛玄选選𨌉穴詢鄩訓亞延言顏酓雁厭央羊昜陽楊痒䌛也夜頁一弌衣宜迻乙以㠯亦邑殹異義𢍰懌斁𤻂寅䖜尹膺纓縈郢甬攸忧蚘訧猶有酉又於于余禺竽魚𢔢逾與玉馭御元𧻚遠𢕼肙曰月刖樂勻帀哉再牂早迮昃𤶑賊𠭯𤹡齋宅占戰𡃣章漳痮瘬𠧞折者貞氶鄭之戠直執至志智廌中終鐘冢舟周朱絑竺宔渚祝砫鉒箸𧢼濁𨚖玆𧿞資子紫自宗卒組左𢼎﨤㺼𡍃𢿼𣬤𣲤𤛉𤦸𪢽𪤝𪱛𪴿𪺞𫃦𫈏𫊣𫑜𫔢𫢁𫨗𫲹𫵖𫹸𫹹𫺍𫾩𫾸𬀑𬅸𬏄𬏪𬒬𬒵𬙮𬚆𬪌𬪝𬪡𬯔𬴥𬸽𬹡";
charset["燕文字編"]="㤅愛安犴豻八百拜𢱭邦勹保北逼鈚比鞭兵丙并病帛卜不參昌長車屮聅臣辰晨承城𥩰乘𠅞𨌤齒赤䌧丑楚𨖇辤賜從萃達大帶𥩳單旦刀得登狄氐釱奠弔丁定𩔡東侗湩都豆脰鋀鍴戹尔耳二乏凡䋣䮳反返范方埅魴非蜚𦄂肥封缶夫鉘𠤳甫复腹丐甘衦𠭖𢽤干倝榦𨹽高膏㚖戈庚工公攻宮共泃狗𨩦估古谷骨詁倌䦎貫癸柜郭𩫖𡓣國還𣳠海韓行禾和河黑𨭆侯矦后虍戶洹繯黄黃怳詯誨𤻀火穫丌吉汲即疾己幾垍惎𨣧家夾甲𧱌兼詃檢建劍諫降𨟻醬焦角教丯戒借金津謹井倞敬丩九臼居駒巨句怇詎遽鋸眷君軍看可克口寇哭匡鍨來俫倈里豊立利苙栗𨏶斂良㐭留六䣚虜𡴆陸膟履虑率馬毛卯孟米糸宓丏滅敏閔明𡨶莫謀母木男南𣲲內鉨年㚔涅妞牛女毆𦂕𦗺庀闢平坪𤽐七𣏶奇𧎪騎臍起啟棄器㤉千凵羌強𢐟喬僑譙秦青𡴐清睘丘萩叴酋浗伹𦐛湶犬人壬任日戎如三剎山痁賞上尚少卲舌申身生𤯓𠇷勝聖師十𤸤豕士氏市事室首受壽疋書蜀豎䢦脽水厶司思死𣦸巳四祀駟宋俗𥻆倠孫所索台郯湯𠬢陶剔田畋𠧪聽𡈼𩑙仝同𨑒徒土脮乇佗迱外𠠪杤王𡴲危為唯爲維未衛文忞巫屋毋吳無五午武戊西肸𨛩息徙喜璽舝下夏弦獻相襄纕絴享肖𨑗辛忻訢新信㓝興休綇駽玄巡牙𠚾厃研𥓋郾羊昜夭窯也冶曳頁一衣医夷𠤕巸詒乙倚椅邑異𨥫義議音陰㹞寅碒瓔浧墉雝永用訧酉又右佑于余渝𣅕𡿯御豫𣶒淵垣月樂勻匀允帀甾哉載𨊦澤怎吒乍宅占章張𠧞者鍺珍貞𢼧塦𨒌正𨚣之衹戠𡌴𦀂職止志智中妐忠鍾重眾堹舟州周帚朱逐壴剸壯壵隹𩓁𠦝䪼斫玆孳子自足尊𢍜左䋅𢽍𣁕𣑮𪣏𪫲𪯽𪱛𪱹𪲉𪾇𫈣𫕝𫯁𫲹𫵾𫷸𫹞𫻷𫾧𬂦𬄰𬌺𬏪𬓚𬔡𬢧𬧵𬪉𬪌𬪜𬶾";
charset["曾侯乙墓竹簡文字編"]="哀安鞌豻獒八白敗攽豹北貝備綳弼鞁鞞邊弁秉駁襮才蔡𨯓驂𣧻曾差長常韔車臣成城椉齒𧝎綢𩋄楚傳春純此翠大𠱾貂定東櫝端椯戹鞥珥二伐𢧕轓凡𥿋反邡紡飛紛燓夫豧巿柫鳬箙甫復衦贛高羔縞戈革庚弓公攻宮鉤姑轂官貴緄棍國果菓還行䝞黑衡㢬𧻿狐𩢪虎𣏼畫劃環繯黄黃騜篲雘丌吉戟𢧢加𩊏甲兼建𥾫金錦晉晶經頸朻九廄舊駒巨聚𢇍君克客騍𨍑軖牢勒䮑䣓貍𣒶豊裏立麗連兩邻陵駵騮六魯录彔路輪旅馬笀毛獏𥁰𥿫㝃𧟡命莫墨貘𣯳牧南𨌵屰㲽聶牛朒旆轡𦃋匹䡟貧牝坪莆七旂齊旗騏㽯啟韒芹卿慶裘𩡶拳犬𨞩人紉韌戎入卅三上少申紳𩉼生賸十石氏事適首疋杸書司亖四𠃢駟宋綏㒸孫所索痰探𤾉𩏋裪滕縢瑅田畋填同彤桐僮銅徒𨌴屯𡱒外王𧛚為韋唯幃爲𥀊維尾愇吴吳無五犀𦱓敮轄下夏弦顯𩎍巷𤠖㨙𧟃新㓝須𨑺軒嬛玄繏削紃迅𤘈弇𪒠鞅羊𩡻夜一欹怡㠯齮耴杙易釴𣨟裛䔬翼因音尹贏佣銿𩏨用遊又右𦏴魚輿與玉馭䮙芫𧻚圓褑月樂囩帀宰載造𦼏䎖柤苲旃斬柘真政鄭之戠執砋至仲𩊄𩍧朱炢駐椎𣃃㺟𧿞子紫自倅組左䢏䧩𡉞𡥣𣬲𤪠𪪺𪭘𪻛𫀧𫏷𫑩𫒊𫘆𫘇𫲹𫾽𬀍𬀑𬏄𬥘𬥦𬨼𬪉𬪜𬯪𭐑𭭨𮌝𮞑𮥢𮩲";
charset["曾文字編"]="哀安鞌𪛏豻獒八犮霸白百柏敗攽般𧬼邦保𡧰寶豹卑北貝備繃庇畢庳弼𢐀鞁縪鞞爂表賓丙秉伯駁鎛襮㙛𡡐不才蔡𨯓參驂𣧻倉𥁗曾差長常腸惝韔車臣辰成郕城乘椉持遲齒𧝎寵綢𩋄初廚楚竐嘼傳春萅純䧳此朿從翠達大代𠱾帶單道稻德狄氐帝奠殿貂𪔹弔殜丁鼎鼑定東都斗脰櫝韇端敦多鐸椯戹鞥而珥爾二伐𢧕轓凡𥿋䋣反方邡芳紡非飛紛𩞑燓缶夫豧巿伏柫畐鳬鳧福箙𠤳甫俌𩠤父赴復𩢿𩒺匃迀衦倝贛高羔睪縞戈割革鬲亘庚工弓公攻宮龏龔共鉤耇枸姑轂古鼓䀇固寡官鰥觀盥圭歸鬼𣪘䤥簋貴𦓃緄棍𩫏國果菓還亥𣐺行和龢黑衡弘㢬侯矦𧻿後乎匫狐壺𩢪虎祜𣏼華畫劃淮褢褱懷洹環繯擐𤃬皇黄黃韹騜彗惠湏會𨗥或雘丌𠀠姬㫷毄箕及吉亟疾𠄹集𦺴雧幾𢧢季既稷加珈嘉𩊏甲叚肩兼𨐄建薦諫江彊疆降𨟻畺酱䢒憍角疌𥾫金𦘔錦晉荆旌晶經井頸誩九廄舊駒巨具虡聚𧇽氒厥絶鴃𢇍爝君呁㽙畯考可克客騍阬孔軖亏剌牢老勒羸䮑貍李𣒶裏醴力立歷麗瀝連𥝞梁粱兩臨陵霝𦉢令駵騮六婁虜魯彔路亂輪蠃吕呂旅馬邁嫚笀毛矛眉沬盟孟𥿫㝃民皿敏明朙鄍鳴𧟡命莫墨某氁牡牧穆乃廼南難𪅀𨌵屰年廿聶牛女朒𣪅槃盤旁𨜷旆轡盆皮𦃋匹䡟貧牝坪䄸頮莆七𣅔桼期紪漆其祈旂齊旗騏啟啓䏿棄器臤喬鐈韒且芹秦琴寑寢𡪷卿慶親邛裘𩡶曲取全𨞩人壬韌日戎乳入叒若𠦃𩃄三喪瑟殺譱商䵼上尚少卲申𢓫深紳𩉼曑愼升生阩𦔻盛聖賸尸師十石史矢始士氏世事是适室睗適噬守𦣻首受壽獸殳疋杸書庶樹司鼶死亖四寺祀飤駟宋𨦢夙𡖊綏隨𠭥歲孫所索台痰醓湯𤾉𩏋裪騊討縢𣽨瑅天田畋填鋚聽彤桐僮銅𨑒土屯沱妥外萬王𦣠望危𠳿愄𧛚為韋唯幃爲𥀊維尾愇鍡韙畏胃軎渭𦞅𥁕文我𣵽𨾘烏吳無𣞤五午迕武䍢勿西析𣂔鄎犀厀溪錫谿席𨑭𦱓徙喜葈卌舄敮𥰶轄𠄟下夏𧷹鮮𩀢弦顯𩎍臽縣獻亯饗巷𤠖孝𧟃燮𤏻心辛新𦛛𥃘曐刑兄戌虚須𨑺𩽆宣軒嬛玄繏削紃迅訊巽牙𤘈嚴鹽匽弇䜭甗𪒠鬳鞅羊洋𠤸也夜業一衣依欹匜怡彝乙㠯齮耴杙易陭埶殹釴義䔬瘞𢍰翼因音殷寅尹㱃印英瓔嬴營縈贏佣墉銿雝饔𩏨永甬𢦨俑用攸憂斿浟遊游有酉𥙫又右糿迂於于余𦏴魚虞𨘕輿敔與玉芋御銉䮙驈剈元芫爰𧻚圓褑邍曰月戉樂煴帀宰載酇臧繰造則𠟭擇昃𦼏䎖柤苲乍齋宅旃斬盞厇者柘㘰真眞𨒌爭正政鄭𥂴之𦭜戠執砋黹徵至中泈盅終鐘仲眾周冑𩍧朱炢壴駐鑄隹追鵻肫斲䶂濁㺟孜子紫自宗走卒族組尊左怍酢𡉞𡝹𡣗𡧛𢥴𣬲𣳾𣼲𤪠𪣡𪦳𪭘𪰊𪴿𪻛𪾒𫀧𫋒𫌿𫍑𫐃𫐜𫑛𫑤𫑩𫒊𫖍𫖘𫗍𫘇𫤱𫧅𫧑𫩞𫬽𫭓𫴃𫵬𫷪𫹛𫹸𫹹𫻴𫻶𫾽𫿒𬀍𬀑𬅵𬉃𬉅𬌚𬏄𬔧𬕑𬕲𬘄𬚬𬜃𬟫𬢙𬥇𬥕𬥘𬥦𬨠𬨼𬪌𬪓𬪚𬪜𬪞𬪤𬫸𬬏𬬚𬳗𬴘𬹟𭐑𭝅𭤐𭱣𮌝𮞑";
