charset["浙江大學藏戰國楚簡"]="嗌安八拔罢白敗暴北背𤰈備奔疕必罼表賓兵丙秉禀稟伯不布才策蠆長朝車臣辰陳成城𨍱逞虫丑出楚遄春鶉辞辭此賜從崔萃寸大待貸禱道㝵𠭁䙷得悳德登狄敵氐帝奠釣丁鼎東隊對多敓敚歺惡而二發伐凡𨑓氾范方房魴非𦄂騑分封風缶夫弗甶福箙府父婦復匄敢高告各給艮庚羹更工公功攻宮苟姑古骨𥮝固故寡官觀管光䢜巂鬼癸貴瘑國還亥害含韓行合何和紇盍黑薨侯餱厚後𨒥垀虖𢏯虎許畫巟皇黃璜隓𩲡會火或霍獲击𥫶積饑吉急疾己戟季既紀畟祭加嘉甲駕戔建姜降𨟻絳姣驕角教皆節解介巾今金堇晉進禁盡旌𦑖景敬競九咎救凥居挶具聚䖭夬㭾絕𢇍君軍可渴克孔恐口苦快貺奎困括牢老雷頪離里豊禮力立吏利栗良粮粱糧量尞林臨焛霝令六飂卵亂𡄹輪律馬茅卯𢘅枚門悶蒙盟孟夢幂免面庿烕滅民明命墨某木穆納乃南囊內能尼郳逆年鳥牛女盘叛丕辟平坪桼亓祈齊乞杞起豈啟啓弃棄器千雃遷喬且侵秦青卿親丘秋曲取去全犬鵲羣群肰然人壬日戎容融如辱瑞銳若弱賽三桑穡沙山善商上尚勺少舍申身曑神升生牲眚盛勝失施十石旹食實史豕始士氏事是室視筮誓守首受壽書輸庶䢦誰水司死巳四寺祀飤肆嗣駟宋穌速雖隨遂歲孫隼𦠆所索灘唐逃討特體天聽同桐童徒圖土退外完亡王枉往𣁋峗為唯圍爲尾蜼未位胃衛魏聞問我屋烏𦤿毋吾吳無五午武勿戊西息喜戲下夏閒賢縣獻相鄉襄亯向巷像校笑心辛新信星興兄休脩羞髹戌敘玄選薛血旬巡荀亞言偃酓黶晏宴燕䳛昜陽柍羕要也枼墷業一夷乙以㠯攺矣乂亦易異義翼因侌音禋寅尹縈庸墉俑用猶友有酉右迂於禺竽魚予羽雨與玉聿欲愈毓𣶒元爰遠曰月閱樂雲鄖帀哉載皂造則責柤𠭯展斬占戰章丈昭兆趙遮折輒蟄者貞真朕爭正政鄭之旨至志制質中終鐘周帚邾咮豬宔杼祝專鄟壯墜宒玆子紫自眥宗郰鉏足卒族罪左佐作﨤𡉣𡋕𡌆𪜿𪢶𪤝𪪂𪯎𪴿𫩞𫻴𬒵𬜪𬴥𮙮";
charset["中山王厝器文字編"]="㤅愛八百𦆕邦保寶卑北備奔萆臂并並竝不步才蔡參曹策曽曾長𦁢車臣䢅成城㮛尺齒處𨕢桘純祠慈辭此𧊒賜從𤠝大怠旦憚刀道㝵𠭁得惪悳𢛳㥁德地帝鼎定鐸訛詻而尒尔二貳廢乏罰法灋反𢓉方汸枋放非篚奮封逢否夫弗桴福𨑟𨑑俌輔父復富敢榦睪告工公功宫宮辜古固寡官觀光椁含閈行和賀侯后後呼忽虖壺虎許荒㞷𡉚𡴍皇惠會徻𨗥或惑禍蒦及吉即集祭禝稷濟𨣧家嘉間簡見建將疆降𨟻角教皆節竭解戒疥今金進盡憼敬九救懅懼氒厥絕𢇍君軍看𥉏考可渴克𢖶恐庫奎闊剌勞老里豊禮力立斂良兩獵林𠳵鄰賃流六𣩍侖論率慮馬茅每美蒙孟庿廟民閔明銘命莫𢘓謀母牡穆難內能𧢕逆年廿念㚔恁寧女彷轡皮闢平坡七其𤵪啟啓弃棄器孯釺喬勤請親睘丘𩡶取去羣群然人壬仁忍日如叡若卅三散嗇山賞上尚少卲舍社申身𥥍深生省眚𦔻盛聖施師十石旹時使氏世丗事是眂受㣽述庶數䢦司死四祀飤嗣送蒐夙孫所它坣堂逃軆體涕替天𤝗聽仝同跿退㥆陀外亡王忘為爲未文䎽聞毋吾吳無五㑄武勿務夕昔息卌𠦜下先鮮閒賢㬎粯相郷鄉祥饗囂小孝斅斆懈心訢新信型休勛焉言嚴弇郾羊昜揚夜業一宜詒遺彝以矣易逸義𣀇斁翼因殷寅飲㱃胤庸永甬用𢆶攸憂猶遊有又右於于余𩁹雩愚雨與語玉䢖馭𣶒淵垣𧻚㝨曰汋粵勻允隕載在葬早則擇詐㒀宅戰折者朕𩉛征氶正之祗戠馶執至志智中忠冢仲重眾𨥇冑㦵誅竹煮貯鑄壯隹追𧿞子宗走祖辠左作𡉣𢊾𢘲𣥜𪟋𪧭𪪋𪫰𪫳𪱞𫊣𫎠𫜢𫡹𫨞𫪔𫭠𫲨𫲪𫳼𫳾𫴔𫵁𫵝𫸙𫹱𫹵𫺐𫺞𫻒𫻲𫼒𬀇𬆑𬇢𬊙𬊛𬋿𬌬𬌳𬍋𬐇𬐘𬔚𬔝𬔡𬔤𬔥𬔷𬕕𬛤𬜫𬞩𬢬𬢭𬢹𬣂𬣋𬣏𬤿𬧿𬨧𬪏𬪜𬪭𬮊𬯝𬰐𬲓";
charset["北京大學藏西漢竹書(貳)文字編_任秋芬"]="哀愛安拔白百佰敗薄葆抱報悲倍被本比鄙必閉敝避臂璧扁辯賓兵並病竝博搏不財采參倉草產長常超朝車勶臣陳成乘誠騁持馳尺赤沖寵出除芻楚畜處絀炊杶春萅疵雌辤此次從脆脃存寸㭫挫錯達大代殆帶淡當道盜得德登抵地帝慸奠冬動梪督獨短躉沌多奪椯惡而兒耳餌二發廢法灋凡反泛方非肥費紛糞風䗬逢奉夫弗伏服福榑輻輔父負復富腹晐䀭蓋甘敢干剛高杲割革各根弓公功共狗詬孤轂谷骨榖固故寡怪官關觀館光廣規鮭歸鬼貴國果過海害含寒行蒿豪好鄗號合何和核賀赫褐黑亨恒侯厚後虖虎戶華化懷患渙晦慧諱昏渾或貨禍飢基畸積雞及吉極棘己幾忌計迹紀祭寄跡稷家莢甲堅見建賤劍鍵鑑江將匠交驕角僥教皆街結解介畍今金矜筋堇僅進墐經精驚靜九久咎救就居舉夬厥絕爵覺戄均君軍楷亢苛可渴克客孔恐口枯苦狂來牢老絫類堎離禮力立利廉歛粱兩獵鄰陵靈六聾僂祿露亂綸馬芒盲沒美沬門猛迷𡓭免勉眇民捪名明冥命末歿莫謀母牡木目牧乃奈難能鳥聶寧怒判伓偏剽貧牝平魄樸其起啟契氣棄器前淺強巧且匧清輕頃請親睘窮求屈詘敺趨曲取去全缺卻然攘熱人仁刃仞日戎容榮柔如辱入耎若弱卅塞三散喪色嗇殺善傷上少奢蛇舍社涉身深什神甚慎生繩盛勝聖失師十食時實識使始士市式事侍是室視適手守首受壽獸疏樞孰蜀屬數䩱爽誰水說司私斯死四祀𧰽肆頌俗素肅狻隋隨遂孫損所台臺泰檮貣天田恬佻聽亭挺同徒圖土推退屯脫橐洼外抏萬亡王枉罔往忘望朢威微為唯爲偽未位味畏衛謂文聞我毋吾無蕪五武勿物希昔谿襲徙卌細柙瑕下先鮮閒賢縣相鄉詳象宵小孝笑歇邪斜心新信刑姓兄兇雄脩虛徐玄學亞焉巖厭燕央陽養恙要燿也一夷巸遺已以佁矣旖亦抑易益埶殹異義音殷陰嬰迎盈熒應勇用幽憂猶游有牖右於竽俞魚隅揄榆愚餘輿予宇雨與語玉浴欲御譽淵蚖遠怨曰約刖樂籥云允運哉宰載在臧鑿蚤趮則責澤賊齋占湛戰章張丈昭召兆者貞真畛袗爭整正政之直執殖止至志制治桎致智置寘中忠終重眾舟逐主壯狀拙叕濁斵茲資子自宗走足罪左佐作坐眞";
charset["北京大學藏西漢竹書(貳)文字編_沈柏汘"]="哀愛安拔白百佰敗薄葆抱報悲倍被本比鄙必閉敝避臂璧扁辯賓冰兵並病竝博搏不財采參倉草策蠆產長常超朝車勶臣陳成乘誠騁持馳尺赤沖寵出除芻楚畜處絀炊杶春萅疵雌辤此次從脆脃存寸㭫挫錯達大代殆帶淡當道盜得德登抵地帝慸奠冬動梪督獨短兌躉沌多奪椯惡而兒耳餌二發廢法灋凡反泛方非肥費紛糞風蜂䗬逢奉夫弗伏服福榑輻輔父負復富腹晐䀭改蓋甘敢干剛高杲割革各根弓公功共狗訽詬沽孤轂古谷骨榖固故寡怪官關觀館光廣規鮭歸鬼貴國果過海害含寒行蒿豪好鄗號欱合何和核賀赫褐黑亨恒恆侯厚後虖虎戶華化觟懷患渙晦慧諱昏昬渾或貨禍𨒪飢基畸積雞及吉極棘己幾忌計迹既紀祭寄跡稷家莢甲堅見建賤劍鍵鑑江將匠交敎驕角僥教皆街結解介畍今金矜筋堇僅進墐經精驚靜九久咎救就居㩴舉夬厥絕爵覺戄均君軍楷亢苛可渴克客孔恐摳口枯苦狂來牢老絫類堎離禮力立利廉歛粱兩列獵鄰陵𩆜靈令六聾僂祿露亂綸馬芒盲沒美沬門猛迷彌𡓭免勉眇民捪㨉名明眀冥命末歿莫謀母牡木目牧乃奈難能鳥聶寧怒判伓偏剽貧牝平𥙃魄樸其齊起啟契氣棄器千前淺強巧且匧清輕頃請親睘窮求屈詘敺趨曲取去全缺卻然攘熱人仁刃仞日戎容榮柔如辱入耎若弱卅塞三散𢿨喪色嗇殺善傷上少奢蛇舍社涉身深什神甚慎生聲繩盛勝聖失師十食時實識使始士市式事侍是室視適手守首受壽獸疏樞孰蜀屬數䩱爽誰水說司私斯死巳四祀𧰽肆頌俗素肅狻隋隨遂孫損所台臺𦬫泰檮貣滕天田恬佻聽亭挺同勭徒圖土槫推退屯脫橐洼外抏萬亡王枉罔往忘盳望朢威微為唯爲偽未位味畏衛謂文聞我毋吾無蕪五武勿物希昔谿襲徙卌細柙瑕下先鮮閒賢縣相鄉詳象宵小孝笑歇邪斜心新信刑姓兄兇雄脩虛徐玄學亞焉言挻嚴巖厭燕央陽養恙要燿也一夷巸遺已以佁矣旖亦抑𢬃易益埶殹異義音殷陰𨒦嬰迎盈熒應勇用幽憂尤猶游有牖右於竽俞魚隅揄榆愚餘輿予宇雨與語玉浴欲御譽淵蚖遠怨曰約刖樂籥云允運㦲哉宰載在臧鑿蚤趮則責澤賊齋占湛戰章張丈昭召兆者貞真畛袗爭𧗲整正政之直執殖止徵至志制治桎致智置寘中忠終重眾舟逐主壯狀拙叕斲濁斵茲資輜子自字宗走足罪尊𢍜左佐作坐䣭𬌲眞";
charset["北京大學藏西漢竹書字表"]="哀𢙴愛安黯敖聱扷八巴拔白百佰敗胞薄葆抱報暴悲北倍被賁本比鄙必畢閉敝痹痺避臂璧扁𠮓辯變𤐫別𠛰賓冰兵并幷並病竝博搏卜不財裁采參倉操草厠策廁察𧍣蠆產産顫長常嘗超朝車勶臣辰陳成丞乘椉誠騁持馳尺赤飭沖寵丑醜出除芻楚処畜處絀穿炊垂杶春萅疵茈雌辤此次從賨脆脃存寸㭫挫錯達大代殆帶丹旦淡當黨道盜得德登抵地弟帝第慸電丁冬東動梪督獨篤端短兌敦沌頓多奪椯惡而兒耏耳餌二貳發廢罰法灋蕃凡反泛方非蜚肥𧕿肺費分紛糞風蜂䗬蠭逢奉夫弗伏服福輻輔父負傅復富腹覆晐䀭盖葢蓋甘肝𠭖敢贛剛高杲告割革觡骼各給根庚㪅更弓公功恭龏共貢狗訽詬沽孤轂古谷股骨榖穀固故寡怪官棺關觀館光廣規龜歸鬼桂貴𦏧𩫏國果過海醢𥂹亥害含寒悍漢行蒿𠞪𠢕豪𩫕𩫚好鄗號欱合何和核賀赫褐黑亨恒恆衡矦厚後虖胡虎𧆞戶華化觟懷環患渙黃悔晦慧諱昏昬渾魂火或貨禍飢基畸箕稽觭積雞及吉即疾極棘藉己幾忌計迹既紀祭寄稷霽家筴甲肩𦙪兼堅間見建賤劎鍵劒鑑江將薑䕬匠交𣐹椒焦驕𤓪角僥繳教噍皆街莭結節解介界畍今金矜矝筋𪑙堇僅勁進墐荊經精驚景脛敬痙靜宭九久咎柩救就居裾㩴舉擧懼鎸鐫夬決厥絕爵覺戄均君軍楷亢苛柯可渴克客孔恐摳口枯苦筐狂亏奎髡髨來牢老雷靁絫類離理禮力立利磿連廉籢歛良粱兩列獵鄰倰陵𤫊靈令流𣹭六龍聾蠪僂禄祿露亂綸論馬芒盲卯沒美沬昧門猛孟迷𢑃緜免勉面眇𥋚民捪㨉名明眀冥朙鳴命磨末歾歿莫貉墨謀母牡木目牧募乃奈柰耐男南難𪅀赧內能廿念鳥聶寧牛怒女歐判伓辟偏剽票貧牝平𥙃魄捊樸㬥七期其肵齊起啟契氣棄器千前黚淺強强巧且匧篋侵芩秦清輕頃請親睘窮𥨪求裘屈詘敺趨驅欋曲取去全缺卻然攘讓熱人壬仁刃仞日戎容榮柔如辱入耎若弱卅塞三散𢿨喪顙色嗇殺山善譱傷賞上少奢蛇舍社涉𣻣申身深蔘曑什神甚慎愼生聲繩盛勝聖失師十食時實識史使始士氏世市式事侍是室視筮試適手守首受壽獸書疏䟽孰蜀屬數䩱衰爽誰水說朔司私斯死巳四兕祀𧰽𤉡笥肆宋送䢠頌俗素肅狻筭隋隨𧴮遂歲孫損所索瑣它台臺𦬫泰唐檮貣苐涕天田恬殄佻儵聽廷亭仝同桐勭穜痛偷頭徒筡圖土槫推退屯拕脫坨駝橐洼外抏骫萬亾亡王网枉罔往妄忘盳朢威微為唯爲維猥僞未位味畏㥜衛衞謂文聞我烏无毋吾無蕪五午武勿物誤希昔息谿襲徙瓕卌𣳦細柙瑕下夏先鮮閒賢䨘䨷相鄉詳享亯象宵小孝校笑斆歇邪奊斜心辛新信㓝刑姓凶兄兇雄䧺脩戌虛徐玄學雪䨮血馴𢵣亞焉言挻嚴黤黭黶厭燕央陽養恙䵮要燿也一夷巸遺乙已以㠯佁矣倚旑旖𢑏亦抑易益埶殹異羛𡎐義撎議音殷陰淫寅嬰𤻮迎盈熒營贏應勇用幽憂尢尤斿猶游猷有酉牖黝右幼於紆于臾竽俞魚隅揄㥥榆愚餘輿予雨圄與語玉浴欲御譽淵原蚖𠫐遠怨曰約月刖越樂𪑲籥云雲允運襍雜哉宰載在臧鑿蚤𧎮趮躁則責澤賊翟占湛戰章張丈昭𦩻召兆𠧞詔趙折㪿者貞眞畛袗軫揕黮𣌦爭正政之枝織直執殖止指至志制治桎致智置寘𣉻䚦中忠終冢重眾舟周朱誅諸竹逐主壯狀拙叕斲𣃃濁𦅾兹玆貲資輜子自字宗走菹足族罪尊𢍜左佐作坐䣭𢪝𬁷𬌲𬞱𭑬𮑀直";
