charset["長沙走馬樓三國吳簡‧竹簡(貳)文字編"]="阿安八霸白百佰㚘薄備伻畢庳婢便表莂邠冰兵稟疒病伯帛逋捕不布材財蔡倉曹岑旵昌萇常陳蔯丞乘池持尺丑初除楮船春淳慈此次葱蔥從撮達大當黨䦒碭道得等鄧邸地弟典佃調牒釘定東董棟都斗豆督篤度段堆碓頓詻恩洏耳番凡杋方斐分逢馮奉夫敷福府付負復腹改盖蓋肝淦贛皋高杲閣給庚弓公宮龔共供狗故寡關觀光廣圭癸詭貴郭還亥旱行晧禾合何和河黑侯胡斛湖鶮虎戶護鋘畫淮黃遑麾回會諱火雞齎及吉麂季紀記佳嘉堅監見建將蔣交節解錦謹京精驚敬九就僦居具聚據捐絹決君軍郡康恪客空恐口枯匡来來撈老橯雷靁耒累梨李里禮力立吏利連廉練梁亮廖列林泠陵淩領令㳅劉六龍聾婁盧魯鹿祿露卵羅雒閭呂慮略馬買麥曼盲毛卯皃枚靡米勉廟民名模末母畝目男南難囊農奴怒女俳排潘旁盆朋皮匹品平攴浦七妻其祺起千芊前錢強橋妾淁秦青清情頃䔛窮丘秋屈區絇曲泉雀鵲囷讓饒人壬任日容如濡汝入弱卅三桑嫂扇善上韶射審慎升生省盛勝師十食史使始士仕市事是收手首售綬書署鼠屬帥水稅碩司私思死四松嵩送溲蘇俗筭遂歲孫所譚炭唐堂騰惕田亭通桐銅統頭屯萬威為尾尉文屋吴吳無五伍武勿物西息狶熹習喜卌細下夏賢限縣相香葙湘向象小孝伳謝心辛欣新信姓兄休珛徐詡絮緒䀏穴學尋訓焉偣言厭陽楊養業一衣壹夷杝宜移遺儀乙已易異詣義億誼因殷寅欽銀盈桯贏應憂友有右柚於䊸魚虞餘與玉遇元員圓遠月運雜造喿責澤賊瞻占湛戰章張丈帳趙折者柘這貞真針偵烝正政鄭織直姪值至致秩誌質擿中忠腫種踵仲重舟州周胄朱諸竹主渚助箸專莊追椎肫准卓粢子紫訾自宗綜緅走租足卒組左作";
charset["出土秦漢小篆文字編"]="阿哀安八霸白百般半邦保寶卑悲碑北備賁比畢裨𡬯便辨表別兵丙並波伯博卜補不布步部材采蔡倉蒼曹冊昌長常敞鈔朝車坼臣辰陳稱成丞承城程澂池尺侈舂仇醜出初廚楚嘼川剶船炊春淳疵祠賜從翠達大代軑戴丹鄲當刀導道盜得德登鄧鐙鞮狄邸底地帝滇典殿丁鼎定東董挏都斗竇督杜度段祋敦頓恩兒二貳發廢法灋蕃煩反范方邡費分奮封豐酆馮奉鳳夫邞伏浮符福府父附傅富駙絠葢甘榦高各根耿更工公宮龔共狗谷罟穀固故官關冠光廣邽歸軌癸炅桂貴郭國果海亥邯旱睅漢行好鄗號禾何和河賀橫衡弘虹侯矦後胡斛壺虎許濩華淮桓豲緩宦皇黃灰恢晦惠會䫟火惑霍獲丌稽吉佶極棘集伎技忌紀祭冀濟加家郟甲假賈姦兼間監儉蹇見建江將彊匠降醬驕狡皆結詰斤今金津晉禁𡩻盡荊涇旌陘徑敬靖𤴪糾九久就廄居橘沮巨具鋗君軍鈞郡康伉克空寇庫廥匡刲葵匱來藍闌蘭郎狼琅閬浪勞累犁犛離斄李理裏立利櫟麗良樑兩量蓼林臨伶泠凌陵令流劉柳六隆龍隴僂蔞盧廬魯陸鹿祿露羅洛雒呂率略馬蠻縵芒貌槑美門蒙猛孟夢麋彌密綿緜廟民閔明命莫粖母牧募睦納乃男南內泥年廿聶寧佞牛農弄奴弩女潘盼佩彭邳郫辟偏票平蒲僕圃溥七郪漆其耆頎齊騎蘄启啟棨栔器千遷黔淺歉羌強橋巧且妾秦青卿清輕頃請親丘秋酋屈趨朐渠曲圈泉饒人壬任日容榮如儒孺汝入芮閏卅塞三桑瑟嗇沙山善商傷上尚少佘社申神審瞫慎升生師十石食時史使始士氏世市事侍室適守首受壽𨛭書舒蜀屬束術水順朔司私思四寺祀飤宋蘇速遂歲旞孫索臺泰郯壇湯唐堂逃洮桃特𦯔天田恬填鐵廷亭同童僮銅突荼徒退屯橐瓦外宛綰萬王望朢巍為唯帷委未尉衛文翁臥巫屋烏毋吳梧無五午武西息奚豨喜憙璽細戲縖下夏鮮咸賢縣相鄉湘襄巷蕭小校歇謝辛訢新鐔信匈雄脩羞戌胥虛須徐栩序昫玄薛辥牙崖閹延言顏嚴鹽衍掩晏雁央羊陽揚楊卬仰養姚銚繇𡢇掖謁一衣壹醫圯夷宜疑乙弋亦邑益肄意義億茵音陰寅尹印嬰營郢穎庸雝永用攸郵遊猷有酉右誘于漁餘輿宇羽禹與浴御獄礜元沅垣原援園苑月越樂雲菑宰贊酇臧駔造則澤齰賊繒翟展斬章張掌召詔趙者真正鄭之支汁織直執止茝志制峙中衷鐘塚重眾州周朱誅諸竹注柱祝𡢀莊壯狀追茲貲子自字宗走租足卒祖尊左作";
